INSERT INTO "handbooks" ("id", "nameHandbook", "imageHandbook", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(4, 'Trẻ hoá da mất bao nhiêu tiền? Chi phí tại 6 địa chỉ uy tín TPHCM', 'data:image/png;base64,', '<h3>Chi phí trẻ hóa da thường có sự dao động lớn bởi những yếu tố như phương pháp thực hiện, thời gian thực hiện, khu vực thực hiện, địa chỉ thực hiện,... Tìm hiểu chi tiết về bảng giá trẻ hóa da tại TPHCM trong bài viết dưới đây.</h3>\n<p>Trẻ hóa da là một xu hướng ngày càng phổ biến trong lĩnh vực chăm sóc sắc đẹp. Với mong muốn có làn da trẻ trung, tươi sáng và đầy sức sống, nhiều chị em đang tìm kiếm các phương pháp và liệu pháp trẻ hóa da hiệu quả.</p>\n<p>Một trong những câu hỏi phổ biến được quan tâm trước khi thực hiện các dịch vụ này đó là: Trẻ hóa da mất bao nhiêu tiền?</p>\n<p>Cùng BookingCare tham khảo bảng giá trẻ hóa tại các địa chỉ uy tín khu vực TPHCM để tìm hiểu thêm bạn nhé!</p>\n<h3>Trẻ hóa da mất bao nhiêu tiền?</h3>\n<p>Không có một con số cố định cho câu hỏi trên, bởi giá tiền của các phương pháp trẻ hóa da có dao động lớn và sẽ phụ thuộc vào nhiều yếu tố chủ quan và khách quan khác nhau.</p>\n<p>Có nhiều yếu tố ảnh hưởng đến chi phí thực hiện trẻ hóa da, tiêu biểu như:</p>\n<ul>\n<li>\n<p>Phương pháp trẻ hóa da: Các phương pháp trẻ hóa da khác nhau có giá cả khác nhau. Ví dụ: Các phương pháp thẩm mỹ công nghệ cao như nâng cơ Ultherapy, Thermage,... có chi phí cao hơn so với trẻ hóa da bằng tiêm tinh chất.</p>\n</li>\n<li></li>\n<li>\n<p>Thời gian và tần suất điều trị: Đối với một số phương pháp, cần thực hiện một số lượng buổi nhất định mới có thể có hiệu quả rõ ràng. Thời gian và tần suất điều trị cũng sẽ ảnh hưởng đến chi phí.</p>\n</li>\n<li></li>\n<li>\n<p>Khu vực da thực hiện trẻ hóa: Chi phí cũng có thể khác nhau tùy thuộc vào vị trí, khu vực da thực hiện. Ví dụ, trẻ hóa da mặt có thể tốn kém hơn so với việc trẻ hóa da trên vùng cổ hoặc tay.</p>\n</li>\n<li>\n<p>Bác sĩ và địa chỉ cung cấp dịch vụ trẻ hóa da: Kinh nghiệm và danh tiếng của bác sĩ, chuyên gia hoặc địa chỉ thực hiện trẻ hóa da cũng có thể ảnh hưởng đến chi phí.</p>\n</li>\n</ul>\n<p>Do các yếu tố trên mà chi phí trẻ hóa da có sự dao động khá lớn. Điều quan trọng là hiểu rõ về các yếu tố này và tham khảo ý kiến chuyên gia, những người đã từng làm trước khi quyết định thực hiện. Khoảng giá chung cho các dịch vụ trẻ hóa da, bạn đọc có thể tham khảo như sau:</p>\n<ul>\n<li>Trẻ hóa da bằng Laser: 10 - 20 triệu đồng</li>\n<li>Trẻ hóa da bằng Ultherapy/ Thermage: 20 - 60 triệu đồng</li>\n<li>Trẻ hóa da Hifu: 10 - 40 triệu đồng</li>\n<li>Căng chỉ trẻ hóa da: 20 - 80 triệu đồng</li>\n</ul>\n<h3>Chi phí trẻ hóa da tại 2 địa chỉ uy tín TPHCM</h3>\n<p>Dưới đây là tổng hợp chi phí trẻ hóa da tại 6 địa chỉ uy tín tại TPHCM. Chị em có thể tham khảo để tìm ra địa chỉ phù hợp với túi tiền nhất.</p>\n<h4>1. Lux Beauty Center</h4>\n<ul>\n<li>\n<p>Địa chỉ: 33C1 Tú Xương, Phường 7, Quận 3, TPHCM</p>\n</li>\n<li>\n<p>Thời gian làm việc:</p>\n<pre><code>  Thứ 2 - thứ 7: 9h00 - 21h00\n  Chủ nhật: 9h00 - 18h00\n</code></pre>\n</li>\n</ul>\n<p>Lux Beauty Clinic là phòng khám da liễu uy tín có thế mạnh về da liễu thẩm mỹ được nhiều chị em tin tưởng thăm khám và thực hiện. Trẻ hóa da là một trong những mảng được phòng khám đầu tư mạnh với nhiều công nghệ trẻ hóa hiện đại, tiên tiến.</p>\n<p>Phụ trách chuyên môn tại Lux Beauty Clinic là Bác sĩ Tô Lan Phương. Bác sĩ Tô Lan Phương có gần 15 năm kinh nghiệm và đã từng tu nghiệp tại các quốc gia có công nghệ làm đẹp tiên tiến như: Thái Lan, Đài Loan, Hongkong, Singapore,... Ngoài ra Bác sĩ Tô Lan Phương còn là:</p>\n<ul>\n<li>Giám đốc chuyên môn Phòng khám Da liễu Lux Beauty Center</li>\n<li>Được tuyển thẳng vào Trường Đại học Y Dược TPHCM</li>\n<li>Thành viên Bác sĩ chính thức sử dụng công nghệ Thermage (CPT, FLX)\n<img src=\"https://cdn.bookingcare.vn/fo/w1200/2022/10/31/100310-dieu-tri-tan-nhang-lux-beauty.jpg\" alt=\"\"></li>\n</ul>\n<h4>2. Bệnh viện thẩm mỹ Thu Cúc Sài Gòn</h4>\n<ul>\n<li>Địa chỉ: 218 Điện Biên Phủ, Quận 3, TPHCM</li>\n<li>Thời gian làm việc: Cả tuần: 8h00 - 18h00</li>\n</ul>\n<p>Thẩm mỹ Thu Cúc trực thuộc Hệ thống y tế Thu Cúc chính thức đi vào hoạt động từ năm 1996, tính tới nay đã có hơn 20 năm kinh nghiệm phục vụ nhu cầu làm đẹp của chị em.</p>\n<p>Là một đơn vị có nền tảng về y tế, vậy nên đội ngũ bác sĩ, kỹ thuật viên cũng như trang thiết bị tại đây rất được chú trọng. Nhiều khách hàng từng thăm khám dành lời khen cho Bệnh viện nhờ &quot;tư vấn lễ tân tiếp đón tốt, bác sĩ và điều dưỡng nhẹ nhàng chu đáo, bệnh viện sạch sẽ&quot;.\n<img src=\"https://cdn.bookingcare.vn/fo/w1200/2024/01/10/171747-bv-tham-my-thu-cuc.png\" alt=\"\"></p>\n', '\n### Chi phí trẻ hóa da thường có sự dao động lớn bởi những yếu tố như phương pháp thực hiện, thời gian thực hiện, khu vực thực hiện, địa chỉ thực hiện,... Tìm hiểu chi tiết về bảng giá trẻ hóa da tại TPHCM trong bài viết dưới đây.\n\nTrẻ hóa da là một xu hướng ngày càng phổ biến trong lĩnh vực chăm sóc sắc đẹp. Với mong muốn có làn da trẻ trung, tươi sáng và đầy sức sống, nhiều chị em đang tìm kiếm các phương pháp và liệu pháp trẻ hóa da hiệu quả.\n\nMột trong những câu hỏi phổ biến được quan tâm trước khi thực hiện các dịch vụ này đó là: Trẻ hóa da mất bao nhiêu tiền?\n\nCùng BookingCare tham khảo bảng giá trẻ hóa tại các địa chỉ uy tín khu vực TPHCM để tìm hiểu thêm bạn nhé!\n\n\n### Trẻ hóa da mất bao nhiêu tiền?\n\nKhông có một con số cố định cho câu hỏi trên, bởi giá tiền của các phương pháp trẻ hóa da có dao động lớn và sẽ phụ thuộc vào nhiều yếu tố chủ quan và khách quan khác nhau.\n\nCó nhiều yếu tố ảnh hưởng đến chi phí thực hiện trẻ hóa da, tiêu biểu như:\n\n* Phương pháp trẻ hóa da: Các phương pháp trẻ hóa da khác nhau có giá cả khác nhau. Ví dụ: Các phương pháp thẩm mỹ công nghệ cao như nâng cơ Ultherapy, Thermage,... có chi phí cao hơn so với trẻ hóa da bằng tiêm tinh chất.\n* \n* Thời gian và tần suất điều trị: Đối với một số phương pháp, cần thực hiện một số lượng buổi nhất định mới có thể có hiệu quả rõ ràng. Thời gian và tần suất điều trị cũng sẽ ảnh hưởng đến chi phí.\n* \n* Khu vực da thực hiện trẻ hóa: Chi phí cũng có thể khác nhau tùy thuộc vào vị trí, khu vực da thực hiện. Ví dụ, trẻ hóa da mặt có thể tốn kém hơn so với việc trẻ hóa da trên vùng cổ hoặc tay.\n\n* Bác sĩ và địa chỉ cung cấp dịch vụ trẻ hóa da: Kinh nghiệm và danh tiếng của bác sĩ, chuyên gia hoặc địa chỉ thực hiện trẻ hóa da cũng có thể ảnh hưởng đến chi phí.\n\nDo các yếu tố trên mà chi phí trẻ hóa da có sự dao động khá lớn. Điều quan trọng là hiểu rõ về các yếu tố này và tham khảo ý kiến chuyên gia, những người đã từng làm trước khi quyết định thực hiện. Khoảng giá chung cho các dịch vụ trẻ hóa da, bạn đọc có thể tham khảo như sau:\n\n* Trẻ hóa da bằng Laser: 10 - 20 triệu đồng\n* Trẻ hóa da bằng Ultherapy/ Thermage: 20 - 60 triệu đồng\n* Trẻ hóa da Hifu: 10 - 40 triệu đồng\n* Căng chỉ trẻ hóa da: 20 - 80 triệu đồng\n\n\n### Chi phí trẻ hóa da tại 2 địa chỉ uy tín TPHCM\n\nDưới đây là tổng hợp chi phí trẻ hóa da tại 6 địa chỉ uy tín tại TPHCM. Chị em có thể tham khảo để tìm ra địa chỉ phù hợp với túi tiền nhất.\n\n\n#### 1. Lux Beauty Center\n\n* Địa chỉ: 33C1 Tú Xương, Phường 7, Quận 3, TPHCM\n* Thời gian làm việc:\n\n        Thứ 2 - thứ 7: 9h00 - 21h00\n        Chủ nhật: 9h00 - 18h00\n\nLux Beauty Clinic là phòng khám da liễu uy tín có thế mạnh về da liễu thẩm mỹ được nhiều chị em tin tưởng thăm khám và thực hiện. Trẻ hóa da là một trong những mảng được phòng khám đầu tư mạnh với nhiều công nghệ trẻ hóa hiện đại, tiên tiến.\n\nPhụ trách chuyên môn tại Lux Beauty Clinic là Bác sĩ Tô Lan Phương. Bác sĩ Tô Lan Phương có gần 15 năm kinh nghiệm và đã từng tu nghiệp tại các quốc gia có công nghệ làm đẹp tiên tiến như: Thái Lan, Đài Loan, Hongkong, Singapore,... Ngoài ra Bác sĩ Tô Lan Phương còn là:\n\n* Giám đốc chuyên môn Phòng khám Da liễu Lux Beauty Center\n* Được tuyển thẳng vào Trường Đại học Y Dược TPHCM\n* Thành viên Bác sĩ chính thức sử dụng công nghệ Thermage (CPT, FLX)\n![](https://cdn.bookingcare.vn/fo/w1200/2022/10/31/100310-dieu-tri-tan-nhang-lux-beauty.jpg)\n\n#### 2. Bệnh viện thẩm mỹ Thu Cúc Sài Gòn\n\n* Địa chỉ: 218 Điện Biên Phủ, Quận 3, TPHCM\n* Thời gian làm việc: Cả tuần: 8h00 - 18h00\n\nThẩm mỹ Thu Cúc trực thuộc Hệ thống y tế Thu Cúc chính thức đi vào hoạt động từ năm 1996, tính tới nay đã có hơn 20 năm kinh nghiệm phục vụ nhu cầu làm đẹp của chị em. \n\nLà một đơn vị có nền tảng về y tế, vậy nên đội ngũ bác sĩ, kỹ thuật viên cũng như trang thiết bị tại đây rất được chú trọng. Nhiều khách hàng từng thăm khám dành lời khen cho Bệnh viện nhờ \"tư vấn lễ tân tiếp đón tốt, bác sĩ và điều dưỡng nhẹ nhàng chu đáo, bệnh viện sạch sẽ\".\n![](https://cdn.bookingcare.vn/fo/w1200/2024/01/10/171747-bv-tham-my-thu-cuc.png)', '2024-01-11 09:27:36', '2024-01-11 09:27:36');
INSERT INTO "handbooks" ("id", "nameHandbook", "imageHandbook", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(5, 'Top 3 địa chỉ trẻ hóa da uy tín tại TPHCM', 'data:image/png;base64,', '<h3>Trẻ hóa da ở đâu uy tín luôn là câu hỏi được rất nhiều chị em quan tâm, tìm hiểu. Cùng BookingCare giải đáp câu hỏi ấy ngay trong bài viết dưới đây.</h3>\n<p>Qua thời gian, da chịu ảnh hưởng của nhiều yếu tố bên ngoài như ánh nắng mặt trời, ô nhiễm môi trường, stress, tuổi tác và di truyền, dẫn đến sự xuất hiện của nếp nhăn, tàn nhang, da mất độ đàn hồi và xỉn màu.</p>\n<p>Để giúp cải thiện các vấn đề này và giữ cho da tươi trẻ, dịch vụ trẻ hóa da ngày càng phổ biến và được nhiều chị em ưa chuộng.</p>\n<p>Tại TPHCM có rất nhiều bệnh viện, phòng khám da liễu, thẩm mỹ viện có dịch vụ trẻ hóa da nhưng không phải chỗ nào cũng đáng tin cậy và đảm bảo an toàn. Tìm hiểu chi tiết top địa chỉ trẻ hóa da uy tín tại TPHCM trong phần nội dung tiếp theo.</p>\n<h3>Tiêu chí lựa chọn địa chỉ trẻ hóa da uy tín</h3>\n<p>Để trẻ hóa da một cách an toàn và hiệu quả thì việc lựa chọn địa chỉ uy tín là bước chuẩn bị vô cùng quan trọng. Lựa chọn địa chỉ trẻ hóa da uy tín vừa giúp đảm bảo kết quả điều trị vừa tránh &quot;tiền mất tật mang&quot;.</p>\n<p>Khi lựa chọn địa chỉ trẻ hóa da, có một số tiêu chí đáng lưu tâm mà bạn đọc có thể xem xét như sau:</p>\n<ul>\n<li>Kinh nghiệm và chuyên môn của bác sĩ: Địa chỉ uy tín thường có đội ngũ bác sĩ có chuyên môn cao trong lĩnh vực trẻ hóa da nói riêng và da liễu thẩm mỹ nói chung.</li>\n<li></li>\n<li>Công nghệ và thiết bị đầy đủ để cung cấp các dịch vụ trẻ hóa da mà địa chỉ đó cung cấp.</li>\n<li>Dịch vụ và quy trình: Tuân thủ các tiêu chuẩn an toàn, tuân thủ quy định của cơ quan y tế và đảm bảo rằng các quy trình được thực hiện bởi người có chuyên môn và kinh nghiệm.</li>\n<li>Đánh giá từ các khách hàng đã thăm khám: Điều này có thể giúp bạn có thêm cái nhìn tổng quan về chất lượng dịch vụ và hiệu quả của từng địa chỉ.</li>\n</ul>\n<p>Hiện có rất nhiều phương pháp trẻ hóa da, một địa chỉ uy tín và một bác sĩ Da liễu có chuyên môn vững vàng sẽ tư vấn chuẩn xác cho bạn với làn da hiện tại thì nên thực hiện phương pháp nào.</p>\n<h3>Top 3 địa chỉ trẻ hóa da uy tín tại TPHCM</h3>\n<p>Dưới đây là những địa chỉ trẻ hóa da uy tín tại TPHCM mà BookingCare đã tổng hợp, chị em quan tâm có thể tham khảo.</p>\n<h4>1. Bệnh viện Da liễu TPHCM</h4>\n<ul>\n<li>Địa chỉ: 2 Đ. Nguyễn Thông, Phường 6, Quận 3, TPHCM\n*Thời gian làm việc:\nThứ 2 - thứ 6: 6h00 - 18h30 (Không nghỉ trưa);<br>\nThứ bảy - Chủ nhật: Sáng: 7h30 - 11h00; Chiều: 13h00 - 18h30\n(Chủ nhật chỉ làm tới 15h00)</li>\n</ul>\n<p>Không cần phải nói quá nhiều để chứng minh sự uy tín của Bệnh viện Da liễu TPHCM, một trong những cơ sở y tế hàng đầu trong lĩnh vực chăm sóc và điều trị các vấn đề liên quan đến da liễu.</p>\n<h4>Trẻ hóa da tại Bệnh viện Da liễu TPHCM</h4>\n<p>Trẻ hóa da là một quá trình giúp cải thiện tình trạng da lão hóa, làm mờ nếp nhăn, tăng độ đàn hồi và sự săn chắc của da. Tại Bệnh viện Da liễu TPHCM, có nhiều phương pháp trẻ hóa da được áp dụng, bao gồm:</p>\n<ul>\n<li>Trẻ hóa da bằng công nghệ ánh sáng IPL</li>\n<li>Trẻ hóa da bằng laser</li>\n<li>Trẻ hóa bằng Thermage</li>\n<li>Trẻ hóa da bằng tiêm Botox</li>\n<li>Trẻ hóa da bằng Uthera\n<img src=\"https://cdn.bookingcare.vn/fo/w1200/2019/09/16/143719benh-vien-da-lieu-tphcm.jpg\" alt=\"\"></li>\n</ul>\n<h4>2. Phòng khám Da liễu Táo Đỏ</h4>\n<ul>\n<li>Địa chỉ: 30/1A Ngô Thời Nhiệm, Phường Võ Thị Sáu, Quận 3, TPHCM</li>\n<li>Thời gian làm việc: Thứ 2 - thứ 7: 08h00 - 21h00 (nhận khách đến 20h30)</li>\n</ul>\n<p>Phòng khám Da liễu Táo Đỏ nằm ở đối diện cổng sau Bệnh viện Da liễu TPHCM, lâu nay đã trở thành địa chỉ thăm khám da liễu được nhiều người tin tưởng.</p>\n<p>Với hơn 10 hoạt động, phòng khám đã triển khai đa dạng dịch vụ từ khám, điều trị các bệnh lý về da cho tới chăm sóc da và thẩm mỹ da đáp ứng nhu cầu người thăm khám.\n<img src=\"https://cdn.bookingcare.vn/fo/w1200/2024/01/09/154838-pk-da-lieu-tao-do.png\" alt=\"\"></p>\n<h4>3. Bệnh viện Thẩm mỹ Việt Mỹ</h4>\n<ul>\n<li>Địa chỉ: 331 Đ. Nguyễn Trãi, Phường Nguyễn Cư Trinh, Quận 1, TPHCM</li>\n<li>Thời gian làm việc: Thứ 2 - thứ 7: 08h00 - 21h00 (nhận khách đến 20h30)</li>\n</ul>\n<p>Bệnh viện Thẩm mỹ Việt Mỹ là một cơ sở chuyên về dịch vụ thẩm mỹ tại TPHCM. Bệnh viện được thành lập với mục tiêu cung cấp các dịch vụ thẩm mỹ công nghệ cao và an toàn cho khách hàng.</p>\n<p>Bệnh viện tọa lạc tại trung tâm Quận 1 với diện tích 3000m2, được thiết kế theo tiêu chuẩn quốc tế, đảm bảo không gian thoải mái mà vẫn giữ được sự riêng tư.\n<img src=\"https://cdn.bookingcare.vn/fo/w1200/2024/01/09/154914-bv-tham-my-viet-my.png\" alt=\"\"></p>\n', '\n### Trẻ hóa da ở đâu uy tín luôn là câu hỏi được rất nhiều chị em quan tâm, tìm hiểu. Cùng BookingCare giải đáp câu hỏi ấy ngay trong bài viết dưới đây.\n\nQua thời gian, da chịu ảnh hưởng của nhiều yếu tố bên ngoài như ánh nắng mặt trời, ô nhiễm môi trường, stress, tuổi tác và di truyền, dẫn đến sự xuất hiện của nếp nhăn, tàn nhang, da mất độ đàn hồi và xỉn màu.\n\nĐể giúp cải thiện các vấn đề này và giữ cho da tươi trẻ, dịch vụ trẻ hóa da ngày càng phổ biến và được nhiều chị em ưa chuộng.\n\nTại TPHCM có rất nhiều bệnh viện, phòng khám da liễu, thẩm mỹ viện có dịch vụ trẻ hóa da nhưng không phải chỗ nào cũng đáng tin cậy và đảm bảo an toàn. Tìm hiểu chi tiết top địa chỉ trẻ hóa da uy tín tại TPHCM trong phần nội dung tiếp theo.\n\n### Tiêu chí lựa chọn địa chỉ trẻ hóa da uy tín\n\nĐể trẻ hóa da một cách an toàn và hiệu quả thì việc lựa chọn địa chỉ uy tín là bước chuẩn bị vô cùng quan trọng. Lựa chọn địa chỉ trẻ hóa da uy tín vừa giúp đảm bảo kết quả điều trị vừa tránh \"tiền mất tật mang\".\n\nKhi lựa chọn địa chỉ trẻ hóa da, có một số tiêu chí đáng lưu tâm mà bạn đọc có thể xem xét như sau:\n\n* Kinh nghiệm và chuyên môn của bác sĩ: Địa chỉ uy tín thường có đội ngũ bác sĩ có chuyên môn cao trong lĩnh vực trẻ hóa da nói riêng và da liễu thẩm mỹ nói chung.\n* \n* Công nghệ và thiết bị đầy đủ để cung cấp các dịch vụ trẻ hóa da mà địa chỉ đó cung cấp.\n* Dịch vụ và quy trình: Tuân thủ các tiêu chuẩn an toàn, tuân thủ quy định của cơ quan y tế và đảm bảo rằng các quy trình được thực hiện bởi người có chuyên môn và kinh nghiệm.\n* Đánh giá từ các khách hàng đã thăm khám: Điều này có thể giúp bạn có thêm cái nhìn tổng quan về chất lượng dịch vụ và hiệu quả của từng địa chỉ.\n\nHiện có rất nhiều phương pháp trẻ hóa da, một địa chỉ uy tín và một bác sĩ Da liễu có chuyên môn vững vàng sẽ tư vấn chuẩn xác cho bạn với làn da hiện tại thì nên thực hiện phương pháp nào.\n\n### Top 3 địa chỉ trẻ hóa da uy tín tại TPHCM\n\nDưới đây là những địa chỉ trẻ hóa da uy tín tại TPHCM mà BookingCare đã tổng hợp, chị em quan tâm có thể tham khảo.\n\n\n#### 1. Bệnh viện Da liễu TPHCM \n\n* Địa chỉ: 2 Đ. Nguyễn Thông, Phường 6, Quận 3, TPHCM\n*Thời gian làm việc: \n         Thứ 2 - thứ 6: 6h00 - 18h30 (Không nghỉ trưa);  \n         Thứ bảy - Chủ nhật: Sáng: 7h30 - 11h00; Chiều: 13h00 - 18h30 \n         (Chủ nhật chỉ làm tới 15h00)\n\nKhông cần phải nói quá nhiều để chứng minh sự uy tín của Bệnh viện Da liễu TPHCM, một trong những cơ sở y tế hàng đầu trong lĩnh vực chăm sóc và điều trị các vấn đề liên quan đến da liễu. \n\n\n#### Trẻ hóa da tại Bệnh viện Da liễu TPHCM\n\nTrẻ hóa da là một quá trình giúp cải thiện tình trạng da lão hóa, làm mờ nếp nhăn, tăng độ đàn hồi và sự săn chắc của da. Tại Bệnh viện Da liễu TPHCM, có nhiều phương pháp trẻ hóa da được áp dụng, bao gồm:\n\n* Trẻ hóa da bằng công nghệ ánh sáng IPL\n* Trẻ hóa da bằng laser\n* Trẻ hóa bằng Thermage\n* Trẻ hóa da bằng tiêm Botox\n* Trẻ hóa da bằng Uthera\n![](https://cdn.bookingcare.vn/fo/w1200/2019/09/16/143719benh-vien-da-lieu-tphcm.jpg)\n\n#### 2. Phòng khám Da liễu Táo Đỏ\n\n* Địa chỉ: 30/1A Ngô Thời Nhiệm, Phường Võ Thị Sáu, Quận 3, TPHCM\n* Thời gian làm việc: Thứ 2 - thứ 7: 08h00 - 21h00 (nhận khách đến 20h30)\n\nPhòng khám Da liễu Táo Đỏ nằm ở đối diện cổng sau Bệnh viện Da liễu TPHCM, lâu nay đã trở thành địa chỉ thăm khám da liễu được nhiều người tin tưởng. \n\nVới hơn 10 hoạt động, phòng khám đã triển khai đa dạng dịch vụ từ khám, điều trị các bệnh lý về da cho tới chăm sóc da và thẩm mỹ da đáp ứng nhu cầu người thăm khám.\n![](https://cdn.bookingcare.vn/fo/w1200/2024/01/09/154838-pk-da-lieu-tao-do.png)\n#### 3. Bệnh viện Thẩm mỹ Việt Mỹ \n\n* Địa chỉ: 331 Đ. Nguyễn Trãi, Phường Nguyễn Cư Trinh, Quận 1, TPHCM\n* Thời gian làm việc: Thứ 2 - thứ 7: 08h00 - 21h00 (nhận khách đến 20h30)\n\nBệnh viện Thẩm mỹ Việt Mỹ là một cơ sở chuyên về dịch vụ thẩm mỹ tại TPHCM. Bệnh viện được thành lập với mục tiêu cung cấp các dịch vụ thẩm mỹ công nghệ cao và an toàn cho khách hàng.\n\nBệnh viện tọa lạc tại trung tâm Quận 1 với diện tích 3000m2, được thiết kế theo tiêu chuẩn quốc tế, đảm bảo không gian thoải mái mà vẫn giữ được sự riêng tư.\n![](https://cdn.bookingcare.vn/fo/w1200/2024/01/09/154914-bv-tham-my-viet-my.png)', '2024-01-11 09:36:37', '2024-01-11 09:36:37');
INSERT INTO "handbooks" ("id", "nameHandbook", "imageHandbook", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(6, 'Ultherapy là gì? Địa chỉ thực hiện Ultherapy uy tín tại TPHCM?', 'data:image/png;base64,', '<h3>Trẻ hóa da ở đâu uy tín luôn là câu hỏi được rất nhiều chị em quan tâm, tìm hiểu. Cùng BookingCare giải đáp câu hỏi ấy ngay trong bài viết dưới đây.</h3>\n<p>Qua thời gian, da chịu ảnh hưởng của nhiều yếu tố bên ngoài như ánh nắng mặt trời, ô nhiễm môi trường, stress, tuổi tác và di truyền, dẫn đến sự xuất hiện của nếp nhăn, tàn nhang, da mất độ đàn hồi và xỉn màu.</p>\n<p>Để giúp cải thiện các vấn đề này và giữ cho da tươi trẻ, dịch vụ trẻ hóa da ngày càng phổ biến và được nhiều chị em ưa chuộng.</p>\n<p>Tại TPHCM có rất nhiều bệnh viện, phòng khám da liễu, thẩm mỹ viện có dịch vụ trẻ hóa da nhưng không phải chỗ nào cũng đáng tin cậy và đảm bảo an toàn. Tìm hiểu chi tiết top địa chỉ trẻ hóa da uy tín tại TPHCM trong phần nội dung tiếp theo.</p>\n<h3>Tiêu chí lựa chọn địa chỉ trẻ hóa da uy tín</h3>\n<p>Để trẻ hóa da một cách an toàn và hiệu quả thì việc lựa chọn địa chỉ uy tín là bước chuẩn bị vô cùng quan trọng. Lựa chọn địa chỉ trẻ hóa da uy tín vừa giúp đảm bảo kết quả điều trị vừa tránh &quot;tiền mất tật mang&quot;.</p>\n<p>Khi lựa chọn địa chỉ trẻ hóa da, có một số tiêu chí đáng lưu tâm mà bạn đọc có thể xem xét như sau:</p>\n<ul>\n<li>Kinh nghiệm và chuyên môn của bác sĩ: Địa chỉ uy tín thường có đội ngũ bác sĩ có chuyên môn cao trong lĩnh vực trẻ hóa da nói riêng và da liễu thẩm mỹ nói chung.</li>\n<li></li>\n<li>Công nghệ và thiết bị đầy đủ để cung cấp các dịch vụ trẻ hóa da mà địa chỉ đó cung cấp.</li>\n<li>Dịch vụ và quy trình: Tuân thủ các tiêu chuẩn an toàn, tuân thủ quy định của cơ quan y tế và đảm bảo rằng các quy trình được thực hiện bởi người có chuyên môn và kinh nghiệm.</li>\n<li>Đánh giá từ các khách hàng đã thăm khám: Điều này có thể giúp bạn có thêm cái nhìn tổng quan về chất lượng dịch vụ và hiệu quả của từng địa chỉ.</li>\n</ul>\n<p>Hiện có rất nhiều phương pháp trẻ hóa da, một địa chỉ uy tín và một bác sĩ Da liễu có chuyên môn vững vàng sẽ tư vấn chuẩn xác cho bạn với làn da hiện tại thì nên thực hiện phương pháp nào.</p>\n<h3>Top 3 địa chỉ trẻ hóa da uy tín tại TPHCM</h3>\n<p>Dưới đây là những địa chỉ trẻ hóa da uy tín tại TPHCM mà BookingCare đã tổng hợp, chị em quan tâm có thể tham khảo.</p>\n<h4>1. Bệnh viện Da liễu TPHCM</h4>\n<ul>\n<li>Địa chỉ: 2 Đ. Nguyễn Thông, Phường 6, Quận 3, TPHCM\n*Thời gian làm việc:\nThứ 2 - thứ 6: 6h00 - 18h30 (Không nghỉ trưa);<br>\nThứ bảy - Chủ nhật: Sáng: 7h30 - 11h00; Chiều: 13h00 - 18h30\n(Chủ nhật chỉ làm tới 15h00)</li>\n</ul>\n<p>Không cần phải nói quá nhiều để chứng minh sự uy tín của Bệnh viện Da liễu TPHCM, một trong những cơ sở y tế hàng đầu trong lĩnh vực chăm sóc và điều trị các vấn đề liên quan đến da liễu.</p>\n<h4>Trẻ hóa da tại Bệnh viện Da liễu TPHCM</h4>\n<p>Trẻ hóa da là một quá trình giúp cải thiện tình trạng da lão hóa, làm mờ nếp nhăn, tăng độ đàn hồi và sự săn chắc của da. Tại Bệnh viện Da liễu TPHCM, có nhiều phương pháp trẻ hóa da được áp dụng, bao gồm:</p>\n<ul>\n<li>Trẻ hóa da bằng công nghệ ánh sáng IPL</li>\n<li>Trẻ hóa da bằng laser</li>\n<li>Trẻ hóa bằng Thermage</li>\n<li>Trẻ hóa da bằng tiêm Botox</li>\n<li>Trẻ hóa da bằng Uthera\n<img src=\"https://cdn.bookingcare.vn/fo/w1200/2019/09/16/143719benh-vien-da-lieu-tphcm.jpg\" alt=\"\"></li>\n</ul>\n<h4>2. Phòng khám Da liễu Táo Đỏ</h4>\n<ul>\n<li>Địa chỉ: 30/1A Ngô Thời Nhiệm, Phường Võ Thị Sáu, Quận 3, TPHCM</li>\n<li>Thời gian làm việc: Thứ 2 - thứ 7: 08h00 - 21h00 (nhận khách đến 20h30)</li>\n</ul>\n<p>Phòng khám Da liễu Táo Đỏ nằm ở đối diện cổng sau Bệnh viện Da liễu TPHCM, lâu nay đã trở thành địa chỉ thăm khám da liễu được nhiều người tin tưởng.</p>\n<p>Với hơn 10 hoạt động, phòng khám đã triển khai đa dạng dịch vụ từ khám, điều trị các bệnh lý về da cho tới chăm sóc da và thẩm mỹ da đáp ứng nhu cầu người thăm khám.\n<img src=\"https://cdn.bookingcare.vn/fo/w1200/2024/01/09/154838-pk-da-lieu-tao-do.png\" alt=\"\"></p>\n<h4>3. Bệnh viện Thẩm mỹ Việt Mỹ</h4>\n<ul>\n<li>Địa chỉ: 331 Đ. Nguyễn Trãi, Phường Nguyễn Cư Trinh, Quận 1, TPHCM</li>\n<li>Thời gian làm việc: Thứ 2 - thứ 7: 08h00 - 21h00 (nhận khách đến 20h30)</li>\n</ul>\n<p>Bệnh viện Thẩm mỹ Việt Mỹ là một cơ sở chuyên về dịch vụ thẩm mỹ tại TPHCM. Bệnh viện được thành lập với mục tiêu cung cấp các dịch vụ thẩm mỹ công nghệ cao và an toàn cho khách hàng.</p>\n<p>Bệnh viện tọa lạc tại trung tâm Quận 1 với diện tích 3000m2, được thiết kế theo tiêu chuẩn quốc tế, đảm bảo không gian thoải mái mà vẫn giữ được sự riêng tư.\n<img src=\"https://cdn.bookingcare.vn/fo/w1200/2024/01/09/154914-bv-tham-my-viet-my.png\" alt=\"\"></p>\n', '\n### Trẻ hóa da ở đâu uy tín luôn là câu hỏi được rất nhiều chị em quan tâm, tìm hiểu. Cùng BookingCare giải đáp câu hỏi ấy ngay trong bài viết dưới đây.\n\nQua thời gian, da chịu ảnh hưởng của nhiều yếu tố bên ngoài như ánh nắng mặt trời, ô nhiễm môi trường, stress, tuổi tác và di truyền, dẫn đến sự xuất hiện của nếp nhăn, tàn nhang, da mất độ đàn hồi và xỉn màu.\n\nĐể giúp cải thiện các vấn đề này và giữ cho da tươi trẻ, dịch vụ trẻ hóa da ngày càng phổ biến và được nhiều chị em ưa chuộng.\n\nTại TPHCM có rất nhiều bệnh viện, phòng khám da liễu, thẩm mỹ viện có dịch vụ trẻ hóa da nhưng không phải chỗ nào cũng đáng tin cậy và đảm bảo an toàn. Tìm hiểu chi tiết top địa chỉ trẻ hóa da uy tín tại TPHCM trong phần nội dung tiếp theo.\n\n### Tiêu chí lựa chọn địa chỉ trẻ hóa da uy tín\n\nĐể trẻ hóa da một cách an toàn và hiệu quả thì việc lựa chọn địa chỉ uy tín là bước chuẩn bị vô cùng quan trọng. Lựa chọn địa chỉ trẻ hóa da uy tín vừa giúp đảm bảo kết quả điều trị vừa tránh \"tiền mất tật mang\".\n\nKhi lựa chọn địa chỉ trẻ hóa da, có một số tiêu chí đáng lưu tâm mà bạn đọc có thể xem xét như sau:\n\n* Kinh nghiệm và chuyên môn của bác sĩ: Địa chỉ uy tín thường có đội ngũ bác sĩ có chuyên môn cao trong lĩnh vực trẻ hóa da nói riêng và da liễu thẩm mỹ nói chung.\n* \n* Công nghệ và thiết bị đầy đủ để cung cấp các dịch vụ trẻ hóa da mà địa chỉ đó cung cấp.\n* Dịch vụ và quy trình: Tuân thủ các tiêu chuẩn an toàn, tuân thủ quy định của cơ quan y tế và đảm bảo rằng các quy trình được thực hiện bởi người có chuyên môn và kinh nghiệm.\n* Đánh giá từ các khách hàng đã thăm khám: Điều này có thể giúp bạn có thêm cái nhìn tổng quan về chất lượng dịch vụ và hiệu quả của từng địa chỉ.\n\nHiện có rất nhiều phương pháp trẻ hóa da, một địa chỉ uy tín và một bác sĩ Da liễu có chuyên môn vững vàng sẽ tư vấn chuẩn xác cho bạn với làn da hiện tại thì nên thực hiện phương pháp nào.\n\n### Top 3 địa chỉ trẻ hóa da uy tín tại TPHCM\n\nDưới đây là những địa chỉ trẻ hóa da uy tín tại TPHCM mà BookingCare đã tổng hợp, chị em quan tâm có thể tham khảo.\n\n\n#### 1. Bệnh viện Da liễu TPHCM \n\n* Địa chỉ: 2 Đ. Nguyễn Thông, Phường 6, Quận 3, TPHCM\n*Thời gian làm việc: \n         Thứ 2 - thứ 6: 6h00 - 18h30 (Không nghỉ trưa);  \n         Thứ bảy - Chủ nhật: Sáng: 7h30 - 11h00; Chiều: 13h00 - 18h30 \n         (Chủ nhật chỉ làm tới 15h00)\n\nKhông cần phải nói quá nhiều để chứng minh sự uy tín của Bệnh viện Da liễu TPHCM, một trong những cơ sở y tế hàng đầu trong lĩnh vực chăm sóc và điều trị các vấn đề liên quan đến da liễu. \n\n\n#### Trẻ hóa da tại Bệnh viện Da liễu TPHCM\n\nTrẻ hóa da là một quá trình giúp cải thiện tình trạng da lão hóa, làm mờ nếp nhăn, tăng độ đàn hồi và sự săn chắc của da. Tại Bệnh viện Da liễu TPHCM, có nhiều phương pháp trẻ hóa da được áp dụng, bao gồm:\n\n* Trẻ hóa da bằng công nghệ ánh sáng IPL\n* Trẻ hóa da bằng laser\n* Trẻ hóa bằng Thermage\n* Trẻ hóa da bằng tiêm Botox\n* Trẻ hóa da bằng Uthera\n![](https://cdn.bookingcare.vn/fo/w1200/2019/09/16/143719benh-vien-da-lieu-tphcm.jpg)\n\n#### 2. Phòng khám Da liễu Táo Đỏ\n\n* Địa chỉ: 30/1A Ngô Thời Nhiệm, Phường Võ Thị Sáu, Quận 3, TPHCM\n* Thời gian làm việc: Thứ 2 - thứ 7: 08h00 - 21h00 (nhận khách đến 20h30)\n\nPhòng khám Da liễu Táo Đỏ nằm ở đối diện cổng sau Bệnh viện Da liễu TPHCM, lâu nay đã trở thành địa chỉ thăm khám da liễu được nhiều người tin tưởng. \n\nVới hơn 10 hoạt động, phòng khám đã triển khai đa dạng dịch vụ từ khám, điều trị các bệnh lý về da cho tới chăm sóc da và thẩm mỹ da đáp ứng nhu cầu người thăm khám.\n![](https://cdn.bookingcare.vn/fo/w1200/2024/01/09/154838-pk-da-lieu-tao-do.png)\n#### 3. Bệnh viện Thẩm mỹ Việt Mỹ \n\n* Địa chỉ: 331 Đ. Nguyễn Trãi, Phường Nguyễn Cư Trinh, Quận 1, TPHCM\n* Thời gian làm việc: Thứ 2 - thứ 7: 08h00 - 21h00 (nhận khách đến 20h30)\n\nBệnh viện Thẩm mỹ Việt Mỹ là một cơ sở chuyên về dịch vụ thẩm mỹ tại TPHCM. Bệnh viện được thành lập với mục tiêu cung cấp các dịch vụ thẩm mỹ công nghệ cao và an toàn cho khách hàng.\n\nBệnh viện tọa lạc tại trung tâm Quận 1 với diện tích 3000m2, được thiết kế theo tiêu chuẩn quốc tế, đảm bảo không gian thoải mái mà vẫn giữ được sự riêng tư.\n![](https://cdn.bookingcare.vn/fo/w1200/2024/01/09/154914-bv-tham-my-viet-my.png)', '2024-01-11 09:39:17', '2024-01-11 09:39:17');
INSERT INTO "handbooks" ("id", "nameHandbook", "imageHandbook", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(7, 'Có nên khám tại Nha khoa Ngân Phượng không? Dịch vụ thế mạnh? Chi phí?', 'data:image/jpeg;base64,', '<h3>Trẻ hóa da ở đâu uy tín luôn là câu hỏi được rất nhiều chị em quan tâm, tìm hiểu. Cùng BookingCare giải đáp câu hỏi ấy ngay trong bài viết dưới đây.</h3>\n<p>Qua thời gian, da chịu ảnh hưởng của nhiều yếu tố bên ngoài như ánh nắng mặt trời, ô nhiễm môi trường, stress, tuổi tác và di truyền, dẫn đến sự xuất hiện của nếp nhăn, tàn nhang, da mất độ đàn hồi và xỉn màu.</p>\n<p>Để giúp cải thiện các vấn đề này và giữ cho da tươi trẻ, dịch vụ trẻ hóa da ngày càng phổ biến và được nhiều chị em ưa chuộng.</p>\n<p>Tại TPHCM có rất nhiều bệnh viện, phòng khám da liễu, thẩm mỹ viện có dịch vụ trẻ hóa da nhưng không phải chỗ nào cũng đáng tin cậy và đảm bảo an toàn. Tìm hiểu chi tiết top địa chỉ trẻ hóa da uy tín tại TPHCM trong phần nội dung tiếp theo.</p>\n<h3>Tiêu chí lựa chọn địa chỉ trẻ hóa da uy tín</h3>\n<p>Để trẻ hóa da một cách an toàn và hiệu quả thì việc lựa chọn địa chỉ uy tín là bước chuẩn bị vô cùng quan trọng. Lựa chọn địa chỉ trẻ hóa da uy tín vừa giúp đảm bảo kết quả điều trị vừa tránh &quot;tiền mất tật mang&quot;.</p>\n<p>Khi lựa chọn địa chỉ trẻ hóa da, có một số tiêu chí đáng lưu tâm mà bạn đọc có thể xem xét như sau:</p>\n<ul>\n<li>Kinh nghiệm và chuyên môn của bác sĩ: Địa chỉ uy tín thường có đội ngũ bác sĩ có chuyên môn cao trong lĩnh vực trẻ hóa da nói riêng và da liễu thẩm mỹ nói chung.</li>\n<li></li>\n<li>Công nghệ và thiết bị đầy đủ để cung cấp các dịch vụ trẻ hóa da mà địa chỉ đó cung cấp.</li>\n<li>Dịch vụ và quy trình: Tuân thủ các tiêu chuẩn an toàn, tuân thủ quy định của cơ quan y tế và đảm bảo rằng các quy trình được thực hiện bởi người có chuyên môn và kinh nghiệm.</li>\n<li>Đánh giá từ các khách hàng đã thăm khám: Điều này có thể giúp bạn có thêm cái nhìn tổng quan về chất lượng dịch vụ và hiệu quả của từng địa chỉ.</li>\n</ul>\n<p>Hiện có rất nhiều phương pháp trẻ hóa da, một địa chỉ uy tín và một bác sĩ Da liễu có chuyên môn vững vàng sẽ tư vấn chuẩn xác cho bạn với làn da hiện tại thì nên thực hiện phương pháp nào.</p>\n<h3>Top 3 địa chỉ trẻ hóa da uy tín tại TPHCM</h3>\n<p>Dưới đây là những địa chỉ trẻ hóa da uy tín tại TPHCM mà BookingCare đã tổng hợp, chị em quan tâm có thể tham khảo.</p>\n<h4>1. Bệnh viện Da liễu TPHCM</h4>\n<ul>\n<li>Địa chỉ: 2 Đ. Nguyễn Thông, Phường 6, Quận 3, TPHCM\n*Thời gian làm việc:\nThứ 2 - thứ 6: 6h00 - 18h30 (Không nghỉ trưa);<br>\nThứ bảy - Chủ nhật: Sáng: 7h30 - 11h00; Chiều: 13h00 - 18h30\n(Chủ nhật chỉ làm tới 15h00)</li>\n</ul>\n<p>Không cần phải nói quá nhiều để chứng minh sự uy tín của Bệnh viện Da liễu TPHCM, một trong những cơ sở y tế hàng đầu trong lĩnh vực chăm sóc và điều trị các vấn đề liên quan đến da liễu.</p>\n<h4>Trẻ hóa da tại Bệnh viện Da liễu TPHCM</h4>\n<p>Trẻ hóa da là một quá trình giúp cải thiện tình trạng da lão hóa, làm mờ nếp nhăn, tăng độ đàn hồi và sự săn chắc của da. Tại Bệnh viện Da liễu TPHCM, có nhiều phương pháp trẻ hóa da được áp dụng, bao gồm:</p>\n<ul>\n<li>Trẻ hóa da bằng công nghệ ánh sáng IPL</li>\n<li>Trẻ hóa da bằng laser</li>\n<li>Trẻ hóa bằng Thermage</li>\n<li>Trẻ hóa da bằng tiêm Botox</li>\n<li>Trẻ hóa da bằng Uthera\n<img src=\"https://cdn.bookingcare.vn/fo/w1200/2019/09/16/143719benh-vien-da-lieu-tphcm.jpg\" alt=\"\"></li>\n</ul>\n<h4>2. Phòng khám Da liễu Táo Đỏ</h4>\n<ul>\n<li>Địa chỉ: 30/1A Ngô Thời Nhiệm, Phường Võ Thị Sáu, Quận 3, TPHCM</li>\n<li>Thời gian làm việc: Thứ 2 - thứ 7: 08h00 - 21h00 (nhận khách đến 20h30)</li>\n</ul>\n<p>Phòng khám Da liễu Táo Đỏ nằm ở đối diện cổng sau Bệnh viện Da liễu TPHCM, lâu nay đã trở thành địa chỉ thăm khám da liễu được nhiều người tin tưởng.</p>\n<p>Với hơn 10 hoạt động, phòng khám đã triển khai đa dạng dịch vụ từ khám, điều trị các bệnh lý về da cho tới chăm sóc da và thẩm mỹ da đáp ứng nhu cầu người thăm khám.\n<img src=\"https://cdn.bookingcare.vn/fo/w1200/2024/01/09/154838-pk-da-lieu-tao-do.png\" alt=\"\"></p>\n<h4>3. Bệnh viện Thẩm mỹ Việt Mỹ</h4>\n<ul>\n<li>Địa chỉ: 331 Đ. Nguyễn Trãi, Phường Nguyễn Cư Trinh, Quận 1, TPHCM</li>\n<li>Thời gian làm việc: Thứ 2 - thứ 7: 08h00 - 21h00 (nhận khách đến 20h30)</li>\n</ul>\n<p>Bệnh viện Thẩm mỹ Việt Mỹ là một cơ sở chuyên về dịch vụ thẩm mỹ tại TPHCM. Bệnh viện được thành lập với mục tiêu cung cấp các dịch vụ thẩm mỹ công nghệ cao và an toàn cho khách hàng.</p>\n<p>Bệnh viện tọa lạc tại trung tâm Quận 1 với diện tích 3000m2, được thiết kế theo tiêu chuẩn quốc tế, đảm bảo không gian thoải mái mà vẫn giữ được sự riêng tư.\n<img src=\"https://cdn.bookingcare.vn/fo/w1200/2024/01/09/154914-bv-tham-my-viet-my.png\" alt=\"\"></p>\n', '\n### Trẻ hóa da ở đâu uy tín luôn là câu hỏi được rất nhiều chị em quan tâm, tìm hiểu. Cùng BookingCare giải đáp câu hỏi ấy ngay trong bài viết dưới đây.\n\nQua thời gian, da chịu ảnh hưởng của nhiều yếu tố bên ngoài như ánh nắng mặt trời, ô nhiễm môi trường, stress, tuổi tác và di truyền, dẫn đến sự xuất hiện của nếp nhăn, tàn nhang, da mất độ đàn hồi và xỉn màu.\n\nĐể giúp cải thiện các vấn đề này và giữ cho da tươi trẻ, dịch vụ trẻ hóa da ngày càng phổ biến và được nhiều chị em ưa chuộng.\n\nTại TPHCM có rất nhiều bệnh viện, phòng khám da liễu, thẩm mỹ viện có dịch vụ trẻ hóa da nhưng không phải chỗ nào cũng đáng tin cậy và đảm bảo an toàn. Tìm hiểu chi tiết top địa chỉ trẻ hóa da uy tín tại TPHCM trong phần nội dung tiếp theo.\n\n### Tiêu chí lựa chọn địa chỉ trẻ hóa da uy tín\n\nĐể trẻ hóa da một cách an toàn và hiệu quả thì việc lựa chọn địa chỉ uy tín là bước chuẩn bị vô cùng quan trọng. Lựa chọn địa chỉ trẻ hóa da uy tín vừa giúp đảm bảo kết quả điều trị vừa tránh \"tiền mất tật mang\".\n\nKhi lựa chọn địa chỉ trẻ hóa da, có một số tiêu chí đáng lưu tâm mà bạn đọc có thể xem xét như sau:\n\n* Kinh nghiệm và chuyên môn của bác sĩ: Địa chỉ uy tín thường có đội ngũ bác sĩ có chuyên môn cao trong lĩnh vực trẻ hóa da nói riêng và da liễu thẩm mỹ nói chung.\n* \n* Công nghệ và thiết bị đầy đủ để cung cấp các dịch vụ trẻ hóa da mà địa chỉ đó cung cấp.\n* Dịch vụ và quy trình: Tuân thủ các tiêu chuẩn an toàn, tuân thủ quy định của cơ quan y tế và đảm bảo rằng các quy trình được thực hiện bởi người có chuyên môn và kinh nghiệm.\n* Đánh giá từ các khách hàng đã thăm khám: Điều này có thể giúp bạn có thêm cái nhìn tổng quan về chất lượng dịch vụ và hiệu quả của từng địa chỉ.\n\nHiện có rất nhiều phương pháp trẻ hóa da, một địa chỉ uy tín và một bác sĩ Da liễu có chuyên môn vững vàng sẽ tư vấn chuẩn xác cho bạn với làn da hiện tại thì nên thực hiện phương pháp nào.\n\n### Top 3 địa chỉ trẻ hóa da uy tín tại TPHCM\n\nDưới đây là những địa chỉ trẻ hóa da uy tín tại TPHCM mà BookingCare đã tổng hợp, chị em quan tâm có thể tham khảo.\n\n\n#### 1. Bệnh viện Da liễu TPHCM \n\n* Địa chỉ: 2 Đ. Nguyễn Thông, Phường 6, Quận 3, TPHCM\n*Thời gian làm việc: \n         Thứ 2 - thứ 6: 6h00 - 18h30 (Không nghỉ trưa);  \n         Thứ bảy - Chủ nhật: Sáng: 7h30 - 11h00; Chiều: 13h00 - 18h30 \n         (Chủ nhật chỉ làm tới 15h00)\n\nKhông cần phải nói quá nhiều để chứng minh sự uy tín của Bệnh viện Da liễu TPHCM, một trong những cơ sở y tế hàng đầu trong lĩnh vực chăm sóc và điều trị các vấn đề liên quan đến da liễu. \n\n\n#### Trẻ hóa da tại Bệnh viện Da liễu TPHCM\n\nTrẻ hóa da là một quá trình giúp cải thiện tình trạng da lão hóa, làm mờ nếp nhăn, tăng độ đàn hồi và sự săn chắc của da. Tại Bệnh viện Da liễu TPHCM, có nhiều phương pháp trẻ hóa da được áp dụng, bao gồm:\n\n* Trẻ hóa da bằng công nghệ ánh sáng IPL\n* Trẻ hóa da bằng laser\n* Trẻ hóa bằng Thermage\n* Trẻ hóa da bằng tiêm Botox\n* Trẻ hóa da bằng Uthera\n![](https://cdn.bookingcare.vn/fo/w1200/2019/09/16/143719benh-vien-da-lieu-tphcm.jpg)\n\n#### 2. Phòng khám Da liễu Táo Đỏ\n\n* Địa chỉ: 30/1A Ngô Thời Nhiệm, Phường Võ Thị Sáu, Quận 3, TPHCM\n* Thời gian làm việc: Thứ 2 - thứ 7: 08h00 - 21h00 (nhận khách đến 20h30)\n\nPhòng khám Da liễu Táo Đỏ nằm ở đối diện cổng sau Bệnh viện Da liễu TPHCM, lâu nay đã trở thành địa chỉ thăm khám da liễu được nhiều người tin tưởng. \n\nVới hơn 10 hoạt động, phòng khám đã triển khai đa dạng dịch vụ từ khám, điều trị các bệnh lý về da cho tới chăm sóc da và thẩm mỹ da đáp ứng nhu cầu người thăm khám.\n![](https://cdn.bookingcare.vn/fo/w1200/2024/01/09/154838-pk-da-lieu-tao-do.png)\n#### 3. Bệnh viện Thẩm mỹ Việt Mỹ \n\n* Địa chỉ: 331 Đ. Nguyễn Trãi, Phường Nguyễn Cư Trinh, Quận 1, TPHCM\n* Thời gian làm việc: Thứ 2 - thứ 7: 08h00 - 21h00 (nhận khách đến 20h30)\n\nBệnh viện Thẩm mỹ Việt Mỹ là một cơ sở chuyên về dịch vụ thẩm mỹ tại TPHCM. Bệnh viện được thành lập với mục tiêu cung cấp các dịch vụ thẩm mỹ công nghệ cao và an toàn cho khách hàng.\n\nBệnh viện tọa lạc tại trung tâm Quận 1 với diện tích 3000m2, được thiết kế theo tiêu chuẩn quốc tế, đảm bảo không gian thoải mái mà vẫn giữ được sự riêng tư.\n![](https://cdn.bookingcare.vn/fo/w1200/2024/01/09/154914-bv-tham-my-viet-my.png)', '2024-01-11 09:39:44', '2024-01-11 09:39:44');
INSERT INTO "handbooks" ("id", "nameHandbook", "imageHandbook", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(8, 'Quy trình niềng răng chuẩn quốc tế tại Nha khoa Lạc Việt Intech', 'data:image/jpeg;base64,', '<h3>Trẻ hóa da ở đâu uy tín luôn là câu hỏi được rất nhiều chị em quan tâm, tìm hiểu. Cùng BookingCare giải đáp câu hỏi ấy ngay trong bài viết dưới đây.</h3>\n<p>Qua thời gian, da chịu ảnh hưởng của nhiều yếu tố bên ngoài như ánh nắng mặt trời, ô nhiễm môi trường, stress, tuổi tác và di truyền, dẫn đến sự xuất hiện của nếp nhăn, tàn nhang, da mất độ đàn hồi và xỉn màu.</p>\n<p>Để giúp cải thiện các vấn đề này và giữ cho da tươi trẻ, dịch vụ trẻ hóa da ngày càng phổ biến và được nhiều chị em ưa chuộng.</p>\n<p>Tại TPHCM có rất nhiều bệnh viện, phòng khám da liễu, thẩm mỹ viện có dịch vụ trẻ hóa da nhưng không phải chỗ nào cũng đáng tin cậy và đảm bảo an toàn. Tìm hiểu chi tiết top địa chỉ trẻ hóa da uy tín tại TPHCM trong phần nội dung tiếp theo.</p>\n<h3>Tiêu chí lựa chọn địa chỉ trẻ hóa da uy tín</h3>\n<p>Để trẻ hóa da một cách an toàn và hiệu quả thì việc lựa chọn địa chỉ uy tín là bước chuẩn bị vô cùng quan trọng. Lựa chọn địa chỉ trẻ hóa da uy tín vừa giúp đảm bảo kết quả điều trị vừa tránh &quot;tiền mất tật mang&quot;.</p>\n<p>Khi lựa chọn địa chỉ trẻ hóa da, có một số tiêu chí đáng lưu tâm mà bạn đọc có thể xem xét như sau:</p>\n<ul>\n<li>Kinh nghiệm và chuyên môn của bác sĩ: Địa chỉ uy tín thường có đội ngũ bác sĩ có chuyên môn cao trong lĩnh vực trẻ hóa da nói riêng và da liễu thẩm mỹ nói chung.</li>\n<li></li>\n<li>Công nghệ và thiết bị đầy đủ để cung cấp các dịch vụ trẻ hóa da mà địa chỉ đó cung cấp.</li>\n<li>Dịch vụ và quy trình: Tuân thủ các tiêu chuẩn an toàn, tuân thủ quy định của cơ quan y tế và đảm bảo rằng các quy trình được thực hiện bởi người có chuyên môn và kinh nghiệm.</li>\n<li>Đánh giá từ các khách hàng đã thăm khám: Điều này có thể giúp bạn có thêm cái nhìn tổng quan về chất lượng dịch vụ và hiệu quả của từng địa chỉ.</li>\n</ul>\n<p>Hiện có rất nhiều phương pháp trẻ hóa da, một địa chỉ uy tín và một bác sĩ Da liễu có chuyên môn vững vàng sẽ tư vấn chuẩn xác cho bạn với làn da hiện tại thì nên thực hiện phương pháp nào.</p>\n<h3>Top 3 địa chỉ trẻ hóa da uy tín tại TPHCM</h3>\n<p>Dưới đây là những địa chỉ trẻ hóa da uy tín tại TPHCM mà BookingCare đã tổng hợp, chị em quan tâm có thể tham khảo.</p>\n<h4>1. Bệnh viện Da liễu TPHCM</h4>\n<ul>\n<li>Địa chỉ: 2 Đ. Nguyễn Thông, Phường 6, Quận 3, TPHCM\n*Thời gian làm việc:\nThứ 2 - thứ 6: 6h00 - 18h30 (Không nghỉ trưa);<br>\nThứ bảy - Chủ nhật: Sáng: 7h30 - 11h00; Chiều: 13h00 - 18h30\n(Chủ nhật chỉ làm tới 15h00)</li>\n</ul>\n<p>Không cần phải nói quá nhiều để chứng minh sự uy tín của Bệnh viện Da liễu TPHCM, một trong những cơ sở y tế hàng đầu trong lĩnh vực chăm sóc và điều trị các vấn đề liên quan đến da liễu.</p>\n<h4>Trẻ hóa da tại Bệnh viện Da liễu TPHCM</h4>\n<p>Trẻ hóa da là một quá trình giúp cải thiện tình trạng da lão hóa, làm mờ nếp nhăn, tăng độ đàn hồi và sự săn chắc của da. Tại Bệnh viện Da liễu TPHCM, có nhiều phương pháp trẻ hóa da được áp dụng, bao gồm:</p>\n<ul>\n<li>Trẻ hóa da bằng công nghệ ánh sáng IPL</li>\n<li>Trẻ hóa da bằng laser</li>\n<li>Trẻ hóa bằng Thermage</li>\n<li>Trẻ hóa da bằng tiêm Botox</li>\n<li>Trẻ hóa da bằng Uthera\n<img src=\"https://cdn.bookingcare.vn/fo/w1200/2019/09/16/143719benh-vien-da-lieu-tphcm.jpg\" alt=\"\"></li>\n</ul>\n<h4>2. Phòng khám Da liễu Táo Đỏ</h4>\n<ul>\n<li>Địa chỉ: 30/1A Ngô Thời Nhiệm, Phường Võ Thị Sáu, Quận 3, TPHCM</li>\n<li>Thời gian làm việc: Thứ 2 - thứ 7: 08h00 - 21h00 (nhận khách đến 20h30)</li>\n</ul>\n<p>Phòng khám Da liễu Táo Đỏ nằm ở đối diện cổng sau Bệnh viện Da liễu TPHCM, lâu nay đã trở thành địa chỉ thăm khám da liễu được nhiều người tin tưởng.</p>\n<p>Với hơn 10 hoạt động, phòng khám đã triển khai đa dạng dịch vụ từ khám, điều trị các bệnh lý về da cho tới chăm sóc da và thẩm mỹ da đáp ứng nhu cầu người thăm khám.\n<img src=\"https://cdn.bookingcare.vn/fo/w1200/2024/01/09/154838-pk-da-lieu-tao-do.png\" alt=\"\"></p>\n<h4>3. Bệnh viện Thẩm mỹ Việt Mỹ</h4>\n<ul>\n<li>Địa chỉ: 331 Đ. Nguyễn Trãi, Phường Nguyễn Cư Trinh, Quận 1, TPHCM</li>\n<li>Thời gian làm việc: Thứ 2 - thứ 7: 08h00 - 21h00 (nhận khách đến 20h30)</li>\n</ul>\n<p>Bệnh viện Thẩm mỹ Việt Mỹ là một cơ sở chuyên về dịch vụ thẩm mỹ tại TPHCM. Bệnh viện được thành lập với mục tiêu cung cấp các dịch vụ thẩm mỹ công nghệ cao và an toàn cho khách hàng.</p>\n<p>Bệnh viện tọa lạc tại trung tâm Quận 1 với diện tích 3000m2, được thiết kế theo tiêu chuẩn quốc tế, đảm bảo không gian thoải mái mà vẫn giữ được sự riêng tư.\n<img src=\"https://cdn.bookingcare.vn/fo/w1200/2024/01/09/154914-bv-tham-my-viet-my.png\" alt=\"\"></p>\n', '\n### Trẻ hóa da ở đâu uy tín luôn là câu hỏi được rất nhiều chị em quan tâm, tìm hiểu. Cùng BookingCare giải đáp câu hỏi ấy ngay trong bài viết dưới đây.\n\nQua thời gian, da chịu ảnh hưởng của nhiều yếu tố bên ngoài như ánh nắng mặt trời, ô nhiễm môi trường, stress, tuổi tác và di truyền, dẫn đến sự xuất hiện của nếp nhăn, tàn nhang, da mất độ đàn hồi và xỉn màu.\n\nĐể giúp cải thiện các vấn đề này và giữ cho da tươi trẻ, dịch vụ trẻ hóa da ngày càng phổ biến và được nhiều chị em ưa chuộng.\n\nTại TPHCM có rất nhiều bệnh viện, phòng khám da liễu, thẩm mỹ viện có dịch vụ trẻ hóa da nhưng không phải chỗ nào cũng đáng tin cậy và đảm bảo an toàn. Tìm hiểu chi tiết top địa chỉ trẻ hóa da uy tín tại TPHCM trong phần nội dung tiếp theo.\n\n### Tiêu chí lựa chọn địa chỉ trẻ hóa da uy tín\n\nĐể trẻ hóa da một cách an toàn và hiệu quả thì việc lựa chọn địa chỉ uy tín là bước chuẩn bị vô cùng quan trọng. Lựa chọn địa chỉ trẻ hóa da uy tín vừa giúp đảm bảo kết quả điều trị vừa tránh \"tiền mất tật mang\".\n\nKhi lựa chọn địa chỉ trẻ hóa da, có một số tiêu chí đáng lưu tâm mà bạn đọc có thể xem xét như sau:\n\n* Kinh nghiệm và chuyên môn của bác sĩ: Địa chỉ uy tín thường có đội ngũ bác sĩ có chuyên môn cao trong lĩnh vực trẻ hóa da nói riêng và da liễu thẩm mỹ nói chung.\n* \n* Công nghệ và thiết bị đầy đủ để cung cấp các dịch vụ trẻ hóa da mà địa chỉ đó cung cấp.\n* Dịch vụ và quy trình: Tuân thủ các tiêu chuẩn an toàn, tuân thủ quy định của cơ quan y tế và đảm bảo rằng các quy trình được thực hiện bởi người có chuyên môn và kinh nghiệm.\n* Đánh giá từ các khách hàng đã thăm khám: Điều này có thể giúp bạn có thêm cái nhìn tổng quan về chất lượng dịch vụ và hiệu quả của từng địa chỉ.\n\nHiện có rất nhiều phương pháp trẻ hóa da, một địa chỉ uy tín và một bác sĩ Da liễu có chuyên môn vững vàng sẽ tư vấn chuẩn xác cho bạn với làn da hiện tại thì nên thực hiện phương pháp nào.\n\n### Top 3 địa chỉ trẻ hóa da uy tín tại TPHCM\n\nDưới đây là những địa chỉ trẻ hóa da uy tín tại TPHCM mà BookingCare đã tổng hợp, chị em quan tâm có thể tham khảo.\n\n\n#### 1. Bệnh viện Da liễu TPHCM \n\n* Địa chỉ: 2 Đ. Nguyễn Thông, Phường 6, Quận 3, TPHCM\n*Thời gian làm việc: \n         Thứ 2 - thứ 6: 6h00 - 18h30 (Không nghỉ trưa);  \n         Thứ bảy - Chủ nhật: Sáng: 7h30 - 11h00; Chiều: 13h00 - 18h30 \n         (Chủ nhật chỉ làm tới 15h00)\n\nKhông cần phải nói quá nhiều để chứng minh sự uy tín của Bệnh viện Da liễu TPHCM, một trong những cơ sở y tế hàng đầu trong lĩnh vực chăm sóc và điều trị các vấn đề liên quan đến da liễu. \n\n\n#### Trẻ hóa da tại Bệnh viện Da liễu TPHCM\n\nTrẻ hóa da là một quá trình giúp cải thiện tình trạng da lão hóa, làm mờ nếp nhăn, tăng độ đàn hồi và sự săn chắc của da. Tại Bệnh viện Da liễu TPHCM, có nhiều phương pháp trẻ hóa da được áp dụng, bao gồm:\n\n* Trẻ hóa da bằng công nghệ ánh sáng IPL\n* Trẻ hóa da bằng laser\n* Trẻ hóa bằng Thermage\n* Trẻ hóa da bằng tiêm Botox\n* Trẻ hóa da bằng Uthera\n![](https://cdn.bookingcare.vn/fo/w1200/2019/09/16/143719benh-vien-da-lieu-tphcm.jpg)\n\n#### 2. Phòng khám Da liễu Táo Đỏ\n\n* Địa chỉ: 30/1A Ngô Thời Nhiệm, Phường Võ Thị Sáu, Quận 3, TPHCM\n* Thời gian làm việc: Thứ 2 - thứ 7: 08h00 - 21h00 (nhận khách đến 20h30)\n\nPhòng khám Da liễu Táo Đỏ nằm ở đối diện cổng sau Bệnh viện Da liễu TPHCM, lâu nay đã trở thành địa chỉ thăm khám da liễu được nhiều người tin tưởng. \n\nVới hơn 10 hoạt động, phòng khám đã triển khai đa dạng dịch vụ từ khám, điều trị các bệnh lý về da cho tới chăm sóc da và thẩm mỹ da đáp ứng nhu cầu người thăm khám.\n![](https://cdn.bookingcare.vn/fo/w1200/2024/01/09/154838-pk-da-lieu-tao-do.png)\n#### 3. Bệnh viện Thẩm mỹ Việt Mỹ \n\n* Địa chỉ: 331 Đ. Nguyễn Trãi, Phường Nguyễn Cư Trinh, Quận 1, TPHCM\n* Thời gian làm việc: Thứ 2 - thứ 7: 08h00 - 21h00 (nhận khách đến 20h30)\n\nBệnh viện Thẩm mỹ Việt Mỹ là một cơ sở chuyên về dịch vụ thẩm mỹ tại TPHCM. Bệnh viện được thành lập với mục tiêu cung cấp các dịch vụ thẩm mỹ công nghệ cao và an toàn cho khách hàng.\n\nBệnh viện tọa lạc tại trung tâm Quận 1 với diện tích 3000m2, được thiết kế theo tiêu chuẩn quốc tế, đảm bảo không gian thoải mái mà vẫn giữ được sự riêng tư.\n![](https://cdn.bookingcare.vn/fo/w1200/2024/01/09/154914-bv-tham-my-viet-my.png)', '2024-01-11 09:40:03', '2024-01-11 09:40:03');
INSERT INTO "infor_doctors" ("id", "contentHTML", "contentMarkdown", "description", "priceType", "noteText", "doctorId", "specialtyId", "clinicId", "createdAt", "updatedAt") VALUES
(2, '<h4>1. Bác sĩ Chuyên khoa II Trần Minh Khuyên</h4>\n<ul>\n<li>\n<p>Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh</p>\n</li>\n<li>\n<p>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)</p>\n</li>\n<li>\n<p>Bác sĩ nhận khám từ 16 tuổi trở lên</p>\n</li>\n</ul>\n<h4>2. Quá trình đào tạo</h4>\n<ul>\n<li>\n<p>Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh</p>\n</li>\n<li>\n<p>Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế</p>\n</li>\n<li>\n<p>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)</p>\n</li>\n</ul>\n<h4>3. Quá trình công tác</h4>\n<ul>\n<li>Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh</li>\n<li>Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh</li>\n<li>Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.</li>\n<li>Khám và điều trị</li>\n<li>Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...</li>\n<li>Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...</li>\n<li>Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...</li>\n<li>Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...</li>\n<li>Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...</li>\n<li>Rối loạn ảo giác</li>\n<li>Các rối loạn liên quan đến stress</li>\n<li>Rối loạn khí sắc</li>\n<li>Rối loạn cảm xúc phân liệt</li>\n<li>Rối loạn đa nhân cách</li>\n<li>Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...</li>\n</ul>\n<p><img src=\"https://images.benhvien115.com.vn/Images/Uploaded/Share/2019/03/29/ae4Binh-Chanh.jpg\" alt=\"\"></p>\n', '#### 1. Bác sĩ Chuyên khoa II Trần Minh Khuyên\n\n* Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\n\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\n\n* Bác sĩ nhận khám từ 16 tuổi trở lên\n\n\n#### 2. Quá trình đào tạo\n\n* Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh\n* Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế\n\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)\n\n\n#### 3. Quá trình công tác\n\n* Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh\n* Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh\n* Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.\n* Khám và điều trị\n* Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...\n* Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...\n* Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...\n* Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...\n* Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...\n* Rối loạn ảo giác\n* Các rối loạn liên quan đến stress\n* Rối loạn khí sắc\n* Rối loạn cảm xúc phân liệt\n* Rối loạn đa nhân cách\n* Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...\n\n![](https://images.benhvien115.com.vn/Images/Uploaded/Share/2019/03/29/ae4Binh-Chanh.jpg)', 'Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\nTốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\nBác sĩ nhận khám từ 16 tuổi trở lên', 'PRI2', ' Giá khám áp dụng cho bệnh nhân là người Việt: 300.000đ', 4, 2, NULL, '2024-01-10 18:57:40', '2024-01-12 02:17:51'),
(3, '<h3>Bác sĩ Chuyên khoa I Nguyễn Trọng Tuân</h3>\n<ul>\n<li>Gần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thần</li>\n<li>Hiện đang công tác tại Bệnh viện Tâm thần TP. HCM</li>\n<li>Thực tập chương trình FFI chuyên ngành Tâm thần tại Bệnh viện TENON, Cộng hòa Pháp</li>\n<li>Bác sĩ nhận khám từ 10 tuổi trở lên</li>\n</ul>\n<h3>Khám và điều trị</h3>\n<p>Bác sĩ nhận khám và điều trị các vấn đề về Tâm thần, Tâm lý:\n*</p>\n<ul>\n<li>Các rối loạn tâm thần cấp tính do stress, do nghiện chất (chất kích thích, ma túy, rượu), tâm thần phân liệt, do bệnh động kinh</li>\n<li>Các rối loạn cảm xúc như trầm cảm, hưng cảm, rối loạn lưỡng cực</li>\n<li>Rối loạn giấc ngủ</li>\n<li>Mất ngủ</li>\n<li>Rối loạn stress</li>\n<li>Sang chấn sau stress</li>\n<li>Đau đầu do căng thẳng</li>\n<li>Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ</li>\n</ul>\n<h3>Quá trình công tác</h3>\n<ul>\n<li>Công tác tại phòng Kế hoạch tổng hợp, Bệnh viện Tâm thần TP. HCM (2004 - nay)</li>\n<li>Quản lý chương trình quốc gia tâm thần và động kinh 24 quận - huyện thuộc TP. HCM</li>\n<li>Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ ở các trường khuyết tật</li>\n<li>Khám sức khỏe tâm thần cho các trung tâm cai nghiện</li>\n</ul>\n<h3>Quá trình đào tạo</h3>\n<ul>\n<li>Bác sĩ Chuyên khoa I ngành Tâm thần, Đại học Y dược TP. HCM (2010 - 2012)</li>\n<li>Thực tập chương trình FFI (Faisant fonction d’interne) chuyên ngành Tâm thần tại Bệnh viện TENON quận 20, Cộng hòa Pháp (2007 - 2008)</li>\n<li>Bác sĩ Y khoa, Trường Đại học Y khoa Phạm Ngọc Thạch (1998 - 2004)</li>\n</ul>\n<h3>Sách, các công trình nghiên cứu và báo cáo khoa học</h3>\n<p>Các nghiên cứu khoa học đã tham gia:</p>\n<ul>\n<li>Tuân thủ điều trị thuốc của bệnh nhân tâm thần phân liệt đang điều trị tại cộng đồng TP. HCM (2016 - 2017)</li>\n<li>Khảo sát hiệu quả liệu pháp gia đình trên bệnh nhân tâm thần phân liệt tại cộng đồng TP. HCM (2014 - 2015)</li>\n<li>Nghiên cứu các rối loạn tâm thần trên bệnh nhân động kinh cơn lớn đang điều trị tại cộng đồng TP. HCM (2013)</li>\n<li>Khảo sát khoảng thời gian loạn thần không điều trị (DUP) và các yếu tố liên quan trên bệnh nhân loạn thần đến khám tại Bệnh viện Tâm thần TP. HCM (2011 - 2012)</li>\n<li>Khảo sát phản ứng tâm lý bệnh nhân tâm thần phân liệt đối với các định kiến xã hội tại TP. HCM (2006)</li>\n</ul>\n', '\n### Bác sĩ Chuyên khoa I Nguyễn Trọng Tuân\n\n* Gần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thần\n* Hiện đang công tác tại Bệnh viện Tâm thần TP. HCM\n* Thực tập chương trình FFI chuyên ngành Tâm thần tại Bệnh viện TENON, Cộng hòa Pháp\n* Bác sĩ nhận khám từ 10 tuổi trở lên\n\n\n### Khám và điều trị\n\nBác sĩ nhận khám và điều trị các vấn đề về Tâm thần, Tâm lý:\n* \n* Các rối loạn tâm thần cấp tính do stress, do nghiện chất (chất kích thích, ma túy, rượu), tâm thần phân liệt, do bệnh động kinh\n* Các rối loạn cảm xúc như trầm cảm, hưng cảm, rối loạn lưỡng cực\n* Rối loạn giấc ngủ\n* Mất ngủ\n* Rối loạn stress\n* Sang chấn sau stress\n* Đau đầu do căng thẳng\n* Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ\n\n\n### Quá trình công tác\n\n* Công tác tại phòng Kế hoạch tổng hợp, Bệnh viện Tâm thần TP. HCM (2004 - nay)\n* Quản lý chương trình quốc gia tâm thần và động kinh 24 quận - huyện thuộc TP. HCM\n* Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ ở các trường khuyết tật\n* Khám sức khỏe tâm thần cho các trung tâm cai nghiện\n\n\n### Quá trình đào tạo\n\n* Bác sĩ Chuyên khoa I ngành Tâm thần, Đại học Y dược TP. HCM (2010 - 2012)\n* Thực tập chương trình FFI (Faisant fonction d’interne) chuyên ngành Tâm thần tại Bệnh viện TENON quận 20, Cộng hòa Pháp (2007 - 2008)\n* Bác sĩ Y khoa, Trường Đại học Y khoa Phạm Ngọc Thạch (1998 - 2004)\n### Sách, các công trình nghiên cứu và báo cáo khoa học\n\n\nCác nghiên cứu khoa học đã tham gia:\n\n\n* Tuân thủ điều trị thuốc của bệnh nhân tâm thần phân liệt đang điều trị tại cộng đồng TP. HCM (2016 - 2017)\n* Khảo sát hiệu quả liệu pháp gia đình trên bệnh nhân tâm thần phân liệt tại cộng đồng TP. HCM (2014 - 2015)\n* Nghiên cứu các rối loạn tâm thần trên bệnh nhân động kinh cơn lớn đang điều trị tại cộng đồng TP. HCM (2013)\n* Khảo sát khoảng thời gian loạn thần không điều trị (DUP) và các yếu tố liên quan trên bệnh nhân loạn thần đến khám tại Bệnh viện Tâm thần TP. HCM (2011 - 2012)\n* Khảo sát phản ứng tâm lý bệnh nhân tâm thần phân liệt đối với các định kiến xã hội tại TP. HCM (2006)', 'Gần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thần\nHiện đang công tác tại Bệnh viện Tâm thần TP. HCM\nThực tập chương trình FFI chuyên ngành Tâm thần tại Bệnh viện TENON, Cộng hòa Pháp', 'PRI3', '- Giá khám áp dụng cho bệnh nhân là người Việt: 300.000đ', 8, 2, NULL, '2024-01-10 19:00:09', '2024-01-12 02:17:32'),
(4, '<h3>Bác sĩ Chuyên khoa I Nguyễn Trọng Tuân</h3>\n<ul>\n<li>Gần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thần</li>\n<li>Hiện đang công tác tại Bệnh viện Tâm thần TP. HCM</li>\n<li>Thực tập chương trình FFI chuyên ngành Tâm thần tại Bệnh viện TENON, Cộng hòa Pháp</li>\n<li>Bác sĩ nhận khám từ 10 tuổi trở lên</li>\n</ul>\n<h3>Khám và điều trị</h3>\n<p>Bác sĩ nhận khám và điều trị các vấn đề về Tâm thần, Tâm lý:</p>\n<ul>\n<li>Các rối loạn tâm thần cấp tính do stress, do nghiện chất (chất kích thích, ma túy, rượu), tâm thần phân liệt, do bệnh động kinh</li>\n<li>Các rối loạn cảm xúc như trầm cảm, hưng cảm, rối loạn lưỡng cực</li>\n<li>Rối loạn giấc ngủ</li>\n<li>Mất ngủ</li>\n<li>Rối loạn stress</li>\n<li>Sang chấn sau stress</li>\n<li>Đau đầu do căng thẳng</li>\n<li>Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ</li>\n</ul>\n<h3>Quá trình công tác</h3>\n<ul>\n<li>Công tác tại phòng Kế hoạch tổng hợp, Bệnh viện Tâm thần TP. HCM (2004 - nay)</li>\n<li>Quản lý chương trình quốc gia tâm thần và động kinh 24 quận - huyện thuộc TP. HCM</li>\n<li>Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ ở các trường khuyết tật</li>\n<li>Khám sức khỏe tâm thần cho các trung tâm cai nghiện</li>\n</ul>\n<h3>Quá trình đào tạo</h3>\n<ul>\n<li>Bác sĩ Chuyên khoa I ngành Tâm thần, Đại học Y dược TP. HCM (2010 - 2012)</li>\n<li>Thực tập chương trình FFI (Faisant fonction d’interne) chuyên ngành Tâm thần tại Bệnh viện TENON quận 20, Cộng hòa Pháp (2007 - 2008)</li>\n<li>Bác sĩ Y khoa, Trường Đại học Y khoa Phạm Ngọc Thạch (1998 - 2004)</li>\n</ul>\n<h3>Sách, các công trình nghiên cứu và báo cáo khoa học</h3>\n<p>Các nghiên cứu khoa học đã tham gia:</p>\n<ul>\n<li>Tuân thủ điều trị thuốc của bệnh nhân tâm thần phân liệt đang điều trị tại cộng đồng TP. HCM (2016 - 2017)</li>\n<li>Khảo sát hiệu quả liệu pháp gia đình trên bệnh nhân tâm thần phân liệt tại cộng đồng TP. HCM (2014 - 2015)</li>\n<li>Nghiên cứu các rối loạn tâm thần trên bệnh nhân động kinh cơn lớn đang điều trị tại cộng đồng TP. HCM (2013)</li>\n<li>Khảo sát khoảng thời gian loạn thần không điều trị (DUP) và các yếu tố liên quan trên bệnh nhân loạn thần đến khám tại Bệnh viện Tâm thần TP. HCM (2011 - 2012)</li>\n<li>Khảo sát phản ứng tâm lý bệnh nhân tâm thần phân liệt đối với các định kiến xã hội tại TP. HCM (2006)</li>\n</ul>\n', '\n### Bác sĩ Chuyên khoa I Nguyễn Trọng Tuân\n\n* Gần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thần\n* Hiện đang công tác tại Bệnh viện Tâm thần TP. HCM\n* Thực tập chương trình FFI chuyên ngành Tâm thần tại Bệnh viện TENON, Cộng hòa Pháp\n* Bác sĩ nhận khám từ 10 tuổi trở lên\n\n\n### Khám và điều trị\n\nBác sĩ nhận khám và điều trị các vấn đề về Tâm thần, Tâm lý:\n\n* Các rối loạn tâm thần cấp tính do stress, do nghiện chất (chất kích thích, ma túy, rượu), tâm thần phân liệt, do bệnh động kinh\n* Các rối loạn cảm xúc như trầm cảm, hưng cảm, rối loạn lưỡng cực\n* Rối loạn giấc ngủ\n* Mất ngủ\n* Rối loạn stress\n* Sang chấn sau stress\n* Đau đầu do căng thẳng\n* Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ\n\n\n### Quá trình công tác\n\n* Công tác tại phòng Kế hoạch tổng hợp, Bệnh viện Tâm thần TP. HCM (2004 - nay)\n* Quản lý chương trình quốc gia tâm thần và động kinh 24 quận - huyện thuộc TP. HCM\n* Khám sức khỏe tâm thần cho các trẻ em bị khiếm khuyết về trí tuệ ở các trường khuyết tật\n* Khám sức khỏe tâm thần cho các trung tâm cai nghiện\n\n\n### Quá trình đào tạo\n\n* Bác sĩ Chuyên khoa I ngành Tâm thần, Đại học Y dược TP. HCM (2010 - 2012)\n* Thực tập chương trình FFI (Faisant fonction d’interne) chuyên ngành Tâm thần tại Bệnh viện TENON quận 20, Cộng hòa Pháp (2007 - 2008)\n* Bác sĩ Y khoa, Trường Đại học Y khoa Phạm Ngọc Thạch (1998 - 2004)\n\n### Sách, các công trình nghiên cứu và báo cáo khoa học\n\nCác nghiên cứu khoa học đã tham gia:\n\n* Tuân thủ điều trị thuốc của bệnh nhân tâm thần phân liệt đang điều trị tại cộng đồng TP. HCM (2016 - 2017)\n* Khảo sát hiệu quả liệu pháp gia đình trên bệnh nhân tâm thần phân liệt tại cộng đồng TP. HCM (2014 - 2015)\n* Nghiên cứu các rối loạn tâm thần trên bệnh nhân động kinh cơn lớn đang điều trị tại cộng đồng TP. HCM (2013)\n* Khảo sát khoảng thời gian loạn thần không điều trị (DUP) và các yếu tố liên quan trên bệnh nhân loạn thần đến khám tại Bệnh viện Tâm thần TP. HCM (2011 - 2012)\n* Khảo sát phản ứng tâm lý bệnh nhân tâm thần phân liệt đối với các định kiến xã hội tại TP. HCM (2006)', 'Gần 20 năm kinh nghiệm khám, chẩn đoán và chữa trị các bệnh lý về Tâm thần\nHiện đang công tác tại Bệnh viện Tâm thần TP. HCM\nThực tập chương trình FFI chuyên ngành Tâm thần tại Bệnh viện TENON, Cộng hòa Pháp\n', 'PRI3', '- Giá khám áp dụng cho bệnh nhân là người Việt: 300.000đ (Người nước ngoài tăng 20%)', 16, 4, NULL, '2024-01-11 09:06:06', '2024-01-12 00:21:08'),
(5, '<h3>Bác sĩ Chuyên khoa II Trần Minh Khuyên</h3>\n<ul>\n<li>Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh</li>\n<li>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)</li>\n<li>Bác sĩ nhận khám từ 16 tuổi trở lên</li>\n</ul>\n<h3>Quá trình đào tạo</h3>\n<ul>\n<li>Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh</li>\n<li>Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế</li>\n<li>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)</li>\n</ul>\n<h3>Quá trình công tác</h3>\n<ul>\n<li>Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh</li>\n<li>Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh</li>\n<li>Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.</li>\n</ul>\n<h3>Khám và điều trị</h3>\n<ul>\n<li>Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...</li>\n<li>Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...</li>\n<li>Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...</li>\n<li>Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...</li>\n<li>Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...</li>\n<li>Rối loạn ảo giác</li>\n<li>Các rối loạn liên quan đến stress</li>\n<li>Rối loạn khí sắc</li>\n<li>Rối loạn cảm xúc phân liệt</li>\n<li>Rối loạn đa nhân cách</li>\n<li>Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)</li>\n</ul>\n<p>...</p>\n', '### Bác sĩ Chuyên khoa II Trần Minh Khuyên\n\n\n* Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\n* Bác sĩ nhận khám từ 16 tuổi trở lên\n\n\n### Quá trình đào tạo\n\n* Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh\n* Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)\n\n\n### Quá trình công tác\n\n* Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh\n* Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh\n* Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.\n\n\n### Khám và điều trị\n\n* Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...\n* Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...\n* Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...\n* Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...\n* Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...\n* Rối loạn ảo giác\n* Các rối loạn liên quan đến stress\n* Rối loạn khí sắc\n* Rối loạn cảm xúc phân liệt\n* Rối loạn đa nhân cách\n* Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)\n\n...', '\nBác sĩ Chuyên khoa II Trần Minh Khuyên\nNguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\nTốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\nBác sĩ nhận khám từ 16 tuổi trở lên', 'PRI4', 'Giá tư vấn 15 phút: 250.000vnđ', 30, 1, NULL, '2024-01-12 02:05:53', '2024-01-12 02:05:53'),
(6, '<h3>Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Thị Hoài An</h3>\n<ul>\n<li>Phó Giáo sư, Tiến sĩ chuyên ngành Tai Mũi Họng</li>\n<li>Nguyên Trưởng khoa Tai Mũi Họng trẻ em, Bệnh viện Tai Mũi Họng Trung ương</li>\n<li>Trên 25 năm công tác tại Bệnh viện Tai Mũi Họng Trung ương</li>\n<li>Bác sĩ Nội trú chuyên ngành Tai Mũi Họng</li>\n<li>Bác sĩ đã từng tu nghiệp Cộng hòa Pháp về Tai Mũi Họng</li>\n</ul>\n<h3>Khám &amp; điều trị</h3>\n<ul>\n<li>Chuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn</li>\n<li>Chuyên khám và điều trị các bệnh lý Tai Mũi Họng trẻ em</li>\n<li>Nội soi Tai Mũi Họng</li>\n<li>Thực hiện các qui trình kỹ thuật Tai Mũi Họng</li>\n</ul>\n<h3>Các bệnh về tai</h3>\n<ul>\n<li>Ù tai, nghe kém, điếc đột ngột</li>\n<li>Chẩy mủ tai, viêm tai giữa cấp, mạn</li>\n<li>Vá màng nhĩ nội soi</li>\n<li>Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài</li>\n</ul>\n<h3>Các bệnh mũi xoang</h3>\n<ul>\n<li>Viêm mũi xoang dị ứng, viêm mũi vận mạch</li>\n<li>Viêm mũi ngạt tắc mũi mạn tính</li>\n<li>Viêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang</li>\n<li>Nấm mũi xoang</li>\n<li>Đau đầu mạn tính do mũi xoang…</li>\n</ul>\n<h3>Các bệnh về họng thanh quản</h3>\n<ul>\n<li>Ở trẻ em viêm VA, viêm mũi họng mạn tính</li>\n<li>Các biến chứng của viêm VA (như viêm tai thanh dịch, viêm tai giữa cấp, viêm thanh khí phế quản….)</li>\n<li>Viêm amiđan cấp, mạn</li>\n<li>Nạo V.A</li>\n<li>Cắt Amidan</li>\n</ul>\n', '\n### Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Thị Hoài An\n\n* Phó Giáo sư, Tiến sĩ chuyên ngành Tai Mũi Họng\n* Nguyên Trưởng khoa Tai Mũi Họng trẻ em, Bệnh viện Tai Mũi Họng Trung ương\n* Trên 25 năm công tác tại Bệnh viện Tai Mũi Họng Trung ương\n* Bác sĩ Nội trú chuyên ngành Tai Mũi Họng\n* Bác sĩ đã từng tu nghiệp Cộng hòa Pháp về Tai Mũi Họng\n\n\n### Khám & điều trị\n\n* Chuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn\n* Chuyên khám và điều trị các bệnh lý Tai Mũi Họng trẻ em\n* Nội soi Tai Mũi Họng\n* Thực hiện các qui trình kỹ thuật Tai Mũi Họng\n\n###  Các bệnh về tai\n\n* Ù tai, nghe kém, điếc đột ngột\n* Chẩy mủ tai, viêm tai giữa cấp, mạn\n* Vá màng nhĩ nội soi\n* Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài\n\n\n### Các bệnh mũi xoang\n\n\n* Viêm mũi xoang dị ứng, viêm mũi vận mạch\n* Viêm mũi ngạt tắc mũi mạn tính\n* Viêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang\n* Nấm mũi xoang\n* Đau đầu mạn tính do mũi xoang…\n\n\n### Các bệnh về họng thanh quản\n\n\n* Ở trẻ em viêm VA, viêm mũi họng mạn tính\n* Các biến chứng của viêm VA (như viêm tai thanh dịch, viêm tai giữa cấp, viêm thanh khí phế quản….)\n* Viêm amiđan cấp, mạn\n* Nạo V.A\n* Cắt Amidan', 'Nguyên Trưởng khoa Tai mũi họng trẻ em, Bệnh viện Tai Mũi Họng Trung ương\nTrên 25 năm công tác tại Bệnh viện Tai mũi họng Trung ương\nChuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn và trẻ em', 'PRI3', 'Khám & Nội soi Tai Mũi họng : 200.000vnđ', 29, 5, NULL, '2024-01-12 02:13:07', '2024-01-12 02:13:23'),
(7, '<h3>Phó Giáo sư, Tiến sĩ, Bác sĩ Cao cấp Nguyễn Duy Hưng</h3>\n<ul>\n<li>Phó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu</li>\n<li>Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương</li>\n<li>Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương</li>\n<li>Đạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan</li>\n<li>Bác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu</li>\n<li>Hội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới</li>\n<li>Giảng viên bộ môn Da liễu tại Đại Học Y Hà Nội</li>\n<li>Trưởng Bộ môn Da liễu, Trường Đại học Kinh doanh và Công nghệ</li>\n<li>Tốt nghiệp Đại học Y Hà Nội (1977)</li>\n<li>Nguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam</li>\n</ul>\n<h3>Phó Giáo sư khám và điều trị</h3>\n<p>Các bệnh lý về chuyên sâu về da liễu người lớn và trẻ em</p>\n<ul>\n<li>Trứng cá thông thường thanh thiếu niên, người lớn, trứng cá do thuốc, mỹ phẩm, do bôi corticord, các thể bệnh trứng cá nặng, trứng cá đỏ (rosacea)</li>\n<li>Điều trị da phục hồi da tổn hại do trứng cá, sẹo trứng cá</li>\n<li>Các bệnh lý da mặt: viêm da dị ứng, tổn hại da do sử dụng mỹ phẩm, do corticord, lão hóa da</li>\n<li>Nám da, tàn nhang, sạm da, các bệnh da tăng sắc tố sau viêm, sau trứng cá, do mỹ phẩm</li>\n<li>Viêm da cơ địa trẻ em và người lớn</li>\n<li>Viêm da dị ứng, viêm da tiếp xúc, viêm da dầu</li>\n<li>Tổ đỉa</li>\n<li>Mày đay</li>\n<li>Bạch biến</li>\n<li>Vảy nến</li>\n<li>Rụng tóc</li>\n<li>Các bệnh da do nhiễm khuẩn: Viêm nang lông, chốc, nhọt, viêm da mủ</li>\n<li>Zona, Thủy đậu, Herpes</li>\n<li>Ghẻ</li>\n<li>Các bênh da do nấm: Nấm nông da, nấm da đầu, nấm móng tay, móng chân, lang ben, nấm men niêm mạc</li>\n<li>Viêm mao mạch dị ứng</li>\n<li>các bệnh da: Có bọng nước, bệnh vẩy phấn hồng, á vẩy nến, liken phẳng, các bệnh da dị ứng thuốc</li>\n<li>U lành tính của da: Đồi mồi, u cổ tuyến mồ hôi, u mềm lây, u mềm treo, u tuyến bã</li>\n<li>Một số bệnh lông - tóc - móng</li>\n<li>Chăm sóc da (skincare)  cho viêm da mặt, trứng cá, liệu trình trị nám, lăn kim, huyết tương giàu tiểu cầu, trị sẹo trứng cá, laser, plasma trị u lành da, nám, đồi mồi</li>\n<li>Tiêm tái sinh nang tóc</li>\n</ul>\n', '\n### Phó Giáo sư, Tiến sĩ, Bác sĩ Cao cấp Nguyễn Duy Hưng\n\n* Phó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu\n* Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương\n* Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương\n* Đạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan\n* Bác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu\n* Hội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới\n* Giảng viên bộ môn Da liễu tại Đại Học Y Hà Nội\n* Trưởng Bộ môn Da liễu, Trường Đại học Kinh doanh và Công nghệ\n* Tốt nghiệp Đại học Y Hà Nội (1977)\n* Nguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam\n\n### Phó Giáo sư khám và điều trị\n\n\nCác bệnh lý về chuyên sâu về da liễu người lớn và trẻ em\n\n* Trứng cá thông thường thanh thiếu niên, người lớn, trứng cá do thuốc, mỹ phẩm, do bôi corticord, các thể bệnh trứng cá nặng, trứng cá đỏ (rosacea)\n* Điều trị da phục hồi da tổn hại do trứng cá, sẹo trứng cá\n* Các bệnh lý da mặt: viêm da dị ứng, tổn hại da do sử dụng mỹ phẩm, do corticord, lão hóa da\n* Nám da, tàn nhang, sạm da, các bệnh da tăng sắc tố sau viêm, sau trứng cá, do mỹ phẩm\n* Viêm da cơ địa trẻ em và người lớn\n* Viêm da dị ứng, viêm da tiếp xúc, viêm da dầu\n* Tổ đỉa\n* Mày đay\n* Bạch biến\n* Vảy nến\n* Rụng tóc\n* Các bệnh da do nhiễm khuẩn: Viêm nang lông, chốc, nhọt, viêm da mủ\n* Zona, Thủy đậu, Herpes\n* Ghẻ\n* Các bênh da do nấm: Nấm nông da, nấm da đầu, nấm móng tay, móng chân, lang ben, nấm men niêm mạc\n* Viêm mao mạch dị ứng\n* các bệnh da: Có bọng nước, bệnh vẩy phấn hồng, á vẩy nến, liken phẳng, các bệnh da dị ứng thuốc\n* U lành tính của da: Đồi mồi, u cổ tuyến mồ hôi, u mềm lây, u mềm treo, u tuyến bã\n* Một số bệnh lông - tóc - móng\n* Chăm sóc da (skincare)  cho viêm da mặt, trứng cá, liệu trình trị nám, lăn kim, huyết tương giàu tiểu cầu, trị sẹo trứng cá, laser, plasma trị u lành da, nám, đồi mồi\n* Tiêm tái sinh nang tóc', 'Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương\nBác sĩ từng công tác tại Bệnh viện Da liễu Trung ương\nNguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam', 'PRI3', 'Giá khám đã bao gồm phí đặt lịch hẹn trước (Giá niêm yết của phòng khám) ;  \nGiá khám cho người nước ngoài 30 USD', 28, 12, NULL, '2024-01-12 02:15:14', '2024-01-12 02:15:14'),
(8, '<h3>Bác sĩ Nguyen Dung</h3>\n<ul>\n<li>Bác sĩ đang công tác tại Phòng khám Đa khoa Quốc tế Nhân Hậu</li>\n<li>Bác sĩ điều trị cơ xương khớp bằng các phương pháp kết hợp y học hiện đại và y học cổ truyền</li>\n</ul>\n<h3>Quá trình công tác</h3>\n<ul>\n<li>Hiện là Bác sĩ khám và điều trị tại Phòng khám Đa khoa Quốc tế Nhân Hậu (2017 - nay)</li>\n<li>Bác sĩ tại Bệnh viện Phục hồi chức năng và Bệnh nghề nghiệp Quận 8 (2015 - 2017)</li>\n</ul>\n<h3>Quá trình đào tạo</h3>\n<ul>\n<li>Tốt nghiệp Bác sĩ Y học cổ truyển, Đại học Y dược TP.HCM (2014)</li>\n<li>Tốt nghiệp Bác sĩ chuyên ngành Nội Tổng hợp, Đại học Y dược Thái Bình (2015)</li>\n<li>Khám và điều trị</li>\n<li>Bác sĩ khám và điều trị các mặt bệnh liên quan đến</li>\n</ul>\n<h3>Cơ xương khớp:</h3>\n<ul>\n<li>Thoái hóa cột sống cổ, cột sống thắt lưng</li>\n<li>Hội chứng ống cổ tay</li>\n<li>Bệnh gout</li>\n<li>Thoái hóa khớp</li>\n<li>Viêm khớp dạng thấp</li>\n</ul>\n', '\n### Bác sĩ Nguyen Dung\n* Bác sĩ đang công tác tại Phòng khám Đa khoa Quốc tế Nhân Hậu\n* Bác sĩ điều trị cơ xương khớp bằng các phương pháp kết hợp y học hiện đại và y học cổ truyền\n\n\n### Quá trình công tác\n\n* Hiện là Bác sĩ khám và điều trị tại Phòng khám Đa khoa Quốc tế Nhân Hậu (2017 - nay)\n* Bác sĩ tại Bệnh viện Phục hồi chức năng và Bệnh nghề nghiệp Quận 8 (2015 - 2017)\n\n\n### Quá trình đào tạo\n\n* Tốt nghiệp Bác sĩ Y học cổ truyển, Đại học Y dược TP.HCM (2014)\n* Tốt nghiệp Bác sĩ chuyên ngành Nội Tổng hợp, Đại học Y dược Thái Bình (2015)\n* Khám và điều trị\n* Bác sĩ khám và điều trị các mặt bệnh liên quan đến\n\n### Cơ xương khớp:\n\n\n* Thoái hóa cột sống cổ, cột sống thắt lưng\n* Hội chứng ống cổ tay\n* Bệnh gout\n* Thoái hóa khớp\n* Viêm khớp dạng thấp', 'Bác sĩ đang công tác tại Phòng khám Đa khoa Quốc tế Nhân Hậu\nBác sĩ điều trị cơ xương khớp bằng các phương pháp kết hợp y học hiện đại và y học cổ truyền\n', 'PRI3', 'Giá khám chưa bao gồm chi phí chụp chiếu, xét nghiệm : 120.000vnd\n', 7, 1, NULL, '2024-01-12 02:20:13', '2024-01-12 02:20:13'),
(9, '<h3>Bác sĩ Chuyên khoa II Võ Văn Mẫn</h3>\n<ul>\n<li>Trưởng khoa Chấn thương Chỉnh hình - Y học Thể thao, Bệnh viện Đa khoa Nam Sài Gòn.</li>\n<li>25 năm kinh nghiệm về Ngoại Chấn thương Chỉnh hình</li>\n<li>Bác sĩ nhận khám mọi độ tuổi</li>\n</ul>\n<h3>Quá trình công tác</h3>\n<ul>\n<li>Trưởng khoa Chấn Thương Chỉnh Hình - Y học Thể thao, Bệnh viện Đa khoa Nam Sài Gòn (Tháng 8/2020 – Nay)</li>\n<li>Trưởng khoa Chấn Thương Chỉnh Hình, Bệnh viện Sài Gòn ITO (2005 – 2020)</li>\n<li>Bác sĩ điều trị Bệnh viện cấp cứu Trưng Vương (2003 – 2005)</li>\n<li>Trưởng khoa Chấn Thương Chỉnh Hình – Bệnh viện Sài Gòn ITO (2001 – 2003)</li>\n<li>Bác sĩ điều trị tại Bệnh viện Chợ Rẫy (1996 - 2001)</li>\n</ul>\n<h3>Quá trình đào tạo</h3>\n<ul>\n<li>Bác sĩ chuyên khoa II chấn thương chỉnh hình, Đại học Y khoa Phạm Ngọc Thạch (2013 – 2015)</li>\n<li>Bác sĩ chuyên khoa I chấn thương chỉnh hình, Đại học Y Dược TP.HCM (1999 – 2001)</li>\n<li>Đại học Y khoa, Đại học Tây Nguyên (1986 – 1992)</li>\n</ul>\n<h3>khám và điều trị</h3>\n<ul>\n<li>Phẫu thuật cột sống</li>\n<li>Thay khớp háng – khớp gối nhân tạo</li>\n<li>Nội soi khớp</li>\n<li>Kết hợp xương</li>\n</ul>\n', '\n### Bác sĩ Chuyên khoa II Võ Văn Mẫn\n\n* Trưởng khoa Chấn thương Chỉnh hình - Y học Thể thao, Bệnh viện Đa khoa Nam Sài Gòn.\n* 25 năm kinh nghiệm về Ngoại Chấn thương Chỉnh hình\n* Bác sĩ nhận khám mọi độ tuổi\n\n### Quá trình công tác\n\n* Trưởng khoa Chấn Thương Chỉnh Hình - Y học Thể thao, Bệnh viện Đa khoa Nam Sài Gòn (Tháng 8/2020 – Nay)\n* Trưởng khoa Chấn Thương Chỉnh Hình, Bệnh viện Sài Gòn ITO (2005 – 2020)\n* Bác sĩ điều trị Bệnh viện cấp cứu Trưng Vương (2003 – 2005)\n* Trưởng khoa Chấn Thương Chỉnh Hình – Bệnh viện Sài Gòn ITO (2001 – 2003)\n* Bác sĩ điều trị tại Bệnh viện Chợ Rẫy (1996 - 2001)\n\n### Quá trình đào tạo\n\n* Bác sĩ chuyên khoa II chấn thương chỉnh hình, Đại học Y khoa Phạm Ngọc Thạch (2013 – 2015)\n* Bác sĩ chuyên khoa I chấn thương chỉnh hình, Đại học Y Dược TP.HCM (1999 – 2001)\n* Đại học Y khoa, Đại học Tây Nguyên (1986 – 1992)\n\n### khám và điều trị \n\n* Phẫu thuật cột sống\n* Thay khớp háng – khớp gối nhân tạo\n* Nội soi khớp\n* Kết hợp xương', 'Trưởng khoa Chấn thương Chỉnh hình - Y học Thể thao, Bệnh viện Đa khoa Nam Sài Gòn\n25 năm kinh nghiệm về Ngoại Chấn thương Chỉnh hình', 'PRI5', 'Giá khám chưa bao gồm chi phí chụp chiếu, xét nghiệm: 300.000vnd', 6, 1, NULL, '2024-01-12 02:21:41', '2024-01-12 02:21:41'),
(10, '<h3>Bác sĩ Chuyên khoa I</h3>\n<ul>\n<li>Nguyên Trưởng khoa Nội Tiêu hóa, Bệnh viện Nguyễn Tri Phương</li>\n<li>26 năm kinh nghiệm trong lĩnh vực Tiêu hóa - Gan mật, đặc biệt viêm gan B, C</li>\n<li>Thường xuyên tham gia các hội nghị về Tiêu hóa - Gan mật Chấu Á Thái Bình Dương tại các Mỹ, Hàn Quốc, Singapore...</li>\n</ul>\n<h3>Quá trình công tác</h3>\n<ul>\n<li>Cố vấn Chuyên môn Phòng khám Gan Tâm Đức (2019 - nay)</li>\n<li>Trưởng khoa Nội Tiêu hóa, Phòng khám Đa khoa Quốc tế Exson</li>\n<li>Trưởng khoa Gan Mật Tiêu hoá và Bác sĩ khám tại Phòng khám VIP Bệnh viện Đại học Y dược Sing Mark, Phòng khám Đa khoa Viet Life,...</li>\n<li>Trưởng khoa Nội Tiêu hóa, Bệnh viện Nguyễn Tri Phương (1984 - 2013)</li>\n</ul>\n<h3>Quá trình đào tạo</h3>\n<ul>\n<li>Tốt nghiệp Chuyên khoa cấp 1, Học viện Quân Y năm 2002</li>\n<li>Tốt nghiệp Chuyên ngành Y - Nội tổng quát, Đại học Y Dược Tp Hồ Chí Minh năm 1984</li>\n</ul>\n<h3>Khám và điều trị</h3>\n<p>Các bệnh lý dạ dày</p>\n<ul>\n<li>Đau dạ dày</li>\n<li>Trào ngược dạ dày - thực quản</li>\n<li>Viêm hang vị dạ dày</li>\n<li>Viêm, loét dạ dày</li>\n<li>Viêm, loét tá tràng</li>\n<li>Viêm loét dạ dày, tá tràng có nhiễm vi khuẩn Helicobacter Pylori</li>\n<li>Xuất huyết tiêu hóa</li>\n</ul>\n<h3>Các bệnh lý về đại tràng, trực tràng</h3>\n<ul>\n<li>Viêm đại tràng</li>\n<li>Viêm loét đại tràng</li>\n<li>Hội chứng ruột kích thích (viêm đại tràng co thắt)</li>\n<li>Bệnh trĩ, trĩ chảy máu</li>\n</ul>\n<h3>Các bệnh lý về gan, mật</h3>\n<ul>\n<li>Sỏi túi mật</li>\n<li>Viêm tụy</li>\n<li>Viêm xơ đường mật</li>\n<li>Viêm xơ gan do rượu</li>\n<li>Viêm tắc đường mật</li>\n<li>Xơ gan</li>\n<li>Gan nhiễm mỡ</li>\n<li>Viêm gan B,C</li>\n</ul>\n', '\n### Bác sĩ Chuyên khoa I \n\n* Nguyên Trưởng khoa Nội Tiêu hóa, Bệnh viện Nguyễn Tri Phương\n* 26 năm kinh nghiệm trong lĩnh vực Tiêu hóa - Gan mật, đặc biệt viêm gan B, C\n* Thường xuyên tham gia các hội nghị về Tiêu hóa - Gan mật Chấu Á Thái Bình Dương tại các Mỹ, Hàn Quốc, Singapore...\n\n### Quá trình công tác \n\n* Cố vấn Chuyên môn Phòng khám Gan Tâm Đức (2019 - nay)\n* Trưởng khoa Nội Tiêu hóa, Phòng khám Đa khoa Quốc tế Exson \n* Trưởng khoa Gan Mật Tiêu hoá và Bác sĩ khám tại Phòng khám VIP Bệnh viện Đại học Y dược Sing Mark, Phòng khám Đa khoa Viet Life,...\n* Trưởng khoa Nội Tiêu hóa, Bệnh viện Nguyễn Tri Phương (1984 - 2013)\n\n### Quá trình đào tạo\n\n* Tốt nghiệp Chuyên khoa cấp 1, Học viện Quân Y năm 2002 \n* Tốt nghiệp Chuyên ngành Y - Nội tổng quát, Đại học Y Dược Tp Hồ Chí Minh năm 1984\n\n### Khám và điều trị \n\n\n Các bệnh lý dạ dày\n\n\n* Đau dạ dày\n* Trào ngược dạ dày - thực quản\n* Viêm hang vị dạ dày\n* Viêm, loét dạ dày\n* Viêm, loét tá tràng\n* Viêm loét dạ dày, tá tràng có nhiễm vi khuẩn Helicobacter Pylori\n* Xuất huyết tiêu hóa\n\n### Các bệnh lý về đại tràng, trực tràng\n\n\n* Viêm đại tràng\n* Viêm loét đại tràng\n* Hội chứng ruột kích thích (viêm đại tràng co thắt)\n* Bệnh trĩ, trĩ chảy máu\n\n### Các bệnh lý về gan, mật \n\n\n* Sỏi túi mật \n* Viêm tụy\n* Viêm xơ đường mật\n* Viêm xơ gan do rượu\n* Viêm tắc đường mật\n* Xơ gan\n* Gan nhiễm mỡ\n* Viêm gan B,C', '40 năm kinh nghiệm trong lĩnh vực Tiêu hóa - Gan mật \nNguyên Trưởng khoa Nội Tiêu hóa, Bệnh viện Nguyễn Tri Phương \n', 'PRI3', 'Giá khám chưa bao gồm chi phí chụp chiếu, xét nghiệm', 5, 3, NULL, '2024-01-12 02:23:25', '2024-01-12 02:23:25');
INSERT INTO "markdowns" ("id", "contentHTML", "contentMarkdown", "description", "priceType", "noteText", "doctorId", "specialtyId", "clinicId", "createdAt", "updatedAt") VALUES
(1, '<h4>1. Bác sĩ Chuyên khoa II Trần Minh Khuyên</h4>\n<ul>\n<li>\n<p>Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh</p>\n</li>\n<li>\n<p>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)</p>\n</li>\n<li>\n<p>Bác sĩ nhận khám từ 16 tuổi trở lên</p>\n</li>\n</ul>\n<h4>2. Quá trình đào tạo</h4>\n<ul>\n<li>\n<p>Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh</p>\n</li>\n<li>\n<p>Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế</p>\n</li>\n<li>\n<p>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)</p>\n</li>\n</ul>\n<h4>3. Quá trình công tác</h4>\n<ul>\n<li>Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh</li>\n<li>Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh</li>\n<li>Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.</li>\n<li>Khám và điều trị</li>\n<li>Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...</li>\n<li>Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...</li>\n<li>Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...</li>\n<li>Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...</li>\n<li>Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...</li>\n<li>Rối loạn ảo giác</li>\n<li>Các rối loạn liên quan đến stress</li>\n<li>Rối loạn khí sắc</li>\n<li>Rối loạn cảm xúc phân liệt</li>\n<li>Rối loạn đa nhân cách</li>\n<li>Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...</li>\n</ul>\n<p><img src=\"https://images.benhvien115.com.vn/Images/Uploaded/Share/2019/03/29/ae4Binh-Chanh.jpg\" alt=\"\"></p>\n', '#### 1. Bác sĩ Chuyên khoa II Trần Minh Khuyên\n\n* Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\n\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\n\n* Bác sĩ nhận khám từ 16 tuổi trở lên\n\n\n#### 2. Quá trình đào tạo\n\n* Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh\n* Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế\n\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)\n\n\n#### 3. Quá trình công tác\n\n* Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh\n* Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh\n* Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.\n* Khám và điều trị\n* Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...\n* Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...\n* Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...\n* Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...\n* Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...\n* Rối loạn ảo giác\n* Các rối loạn liên quan đến stress\n* Rối loạn khí sắc\n* Rối loạn cảm xúc phân liệt\n* Rối loạn đa nhân cách\n* Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...\n\n![](https://images.benhvien115.com.vn/Images/Uploaded/Share/2019/03/29/ae4Binh-Chanh.jpg)', 'Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\nTốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\nBác sĩ nhận khám từ 16 tuổi trở lên', 'PRI2', ' Giá khám áp dụng cho bệnh nhân là người Việt: 300.000đ', 4, 1, NULL, '2023-12-29 00:27:15', '2024-01-10 17:42:21');
