INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(1, 'Cơ Xương Khớp', 'data:image/png;base64,', '<h3>Cơ Xương Khớp</h3>\n<h4>Bác sĩ Cơ Xương Khớp giỏi</h4>\n<ul>\n<li>Danh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:</li>\n<li></li>\n<li>Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm</li>\n<li>Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.</li>\n<li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</li>\n</ul>\n<h4>Bệnh Cơ Xương Khớp</h4>\n<ul>\n<li>Gout</li>\n<li>Thoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ</li>\n<li>Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân</li>\n<li>Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai</li>\n<li>Loãng xương, đau nhức xương</li>\n<li>Viêm xương, gai xương</li>\n<li>Viêm cơ, Teo cơ, chứng đau mỏi cơ</li>\n<li>Yếu cơ, Loạn dưỡng cơ</li>\n<li>Các chấn thương về cơ, xương, khớp</li>\n<li>...</li>\n</ul>\n', '\n### Cơ Xương Khớp\n\n\n#### Bác sĩ Cơ Xương Khớp giỏi\n\n* Danh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:\n* \n* Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm\n* Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.\n* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\n\n\n#### Bệnh Cơ Xương Khớp\n\n* Gout\n* Thoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ\n* Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân\n* Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai\n* Loãng xương, đau nhức xương\n* Viêm xương, gai xương\n* Viêm cơ, Teo cơ, chứng đau mỏi cơ\n* Yếu cơ, Loạn dưỡng cơ\n* Các chấn thương về cơ, xương, khớp\n* ...', '2024-01-09 22:36:03', '2024-01-10 20:35:05');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(2, 'Thần kinh', 'data:image/png;base64,', '<h3>Thần kinh</h3>\n<h4>Bác sĩ Thần kinh giỏi</h4>\n<ul>\n<li>Danh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:</li>\n<li></li>\n<li>Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.</li>\n<li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.</li>\n</ul>\n<h4>Khám bệnh chuyên khoa Thần kinh</h4>\n<ul>\n<li>Bại Não</li>\n<li>Đau đầu, chóng mặt, buồn nôn</li>\n<li>Bệnh Pakison, bệnh tiền đình</li>\n<li>Bị co cơ, căng dây thần kinh</li>\n<li>Động kinh, có những cơn vãng ý thức</li>\n<li>Bị tê bì nửa mặt, chèn dây thần kinh</li>\n<li>Bồn chồn, lo lắng, hồi hộp, chân tay run</li>\n<li>Có dấu hiệu tăng động</li>\n<li>Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi</li>\n<li>Chấn thương đầu, dây thần kinh</li>\n<li>...</li>\n</ul>\n', '\n### Thần kinh\n\n\n#### Bác sĩ Thần kinh giỏi\n\n* Danh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:\n* \n* Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.\n* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.\n\n\n#### Khám bệnh chuyên khoa Thần kinh\n\n* Bại Não	   \n* Đau đầu, chóng mặt, buồn nôn   \n* Bệnh Pakison, bệnh tiền đình	   \n* Bị co cơ, căng dây thần kinh	       \n* Động kinh, có những cơn vãng ý thức	   \n* Bị tê bì nửa mặt, chèn dây thần kinh\n* Bồn chồn, lo lắng, hồi hộp, chân tay run	   \n* Có dấu hiệu tăng động	    \n* Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi   \n* Chấn thương đầu, dây thần kinh\n* ...', '2024-01-09 23:17:14', '2024-01-09 23:17:14');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(3, 'Tiêu hoá', 'data:image/png;base64,', '<h3>Tiêu hoá</h3>\n<h4>Bác sĩ Chuyên khoa Tiêu hóa</h4>\n<ul>\n<li>Danh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:</li>\n<li></li>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội</li>\n<li>Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...</li>\n</ul>\n<h4>Tư vấn, khám và điều trị các Bệnh Tiêu hóa</h4>\n<ul>\n<li>Ăn uống kém, không ngon</li>\n<li>Rối loạn tiêu hóa, táo bón, trĩ</li>\n<li>Nhiễm vi khuẩn HP (Helicobacter pylori)</li>\n<li>Nội soi dạ dày, đại tràng, tiêu hóa</li>\n<li>Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi</li>\n<li>Co thắt thực quản, Hội chứng ruột kích thích</li>\n<li>Đau bụng, dạ dày, đại tràng, thượng vị</li>\n<li>Viêm đại tràng, dạ dày, tá tràng</li>\n<li>Ung thư dạ dày, U nang tuyến tụy</li>\n<li>Bệnh lý về gan, mật</li>\n<li>...</li>\n</ul>\n', '\n### Tiêu hoá\n\n#### Bác sĩ Chuyên khoa Tiêu hóa\n\n* Danh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:\n* \n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội\n* Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...\n\n#### Tư vấn, khám và điều trị các Bệnh Tiêu hóa\n\n\n* Ăn uống kém, không ngon\n* Rối loạn tiêu hóa, táo bón, trĩ\n* Nhiễm vi khuẩn HP (Helicobacter pylori)\n* Nội soi dạ dày, đại tràng, tiêu hóa\n* Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi\n* Co thắt thực quản, Hội chứng ruột kích thích\n* Đau bụng, dạ dày, đại tràng, thượng vị\n* Viêm đại tràng, dạ dày, tá tràng\n* Ung thư dạ dày, U nang tuyến tụy\n* Bệnh lý về gan, mật\n* ...', '2024-01-09 23:18:58', '2024-01-10 14:28:08');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(4, 'Tim mạch', 'data:image/png;base64,', '<h3>Tim mạch</h3>\n<h4>Bác sĩ Chuyên khoa Tiêu hóa</h4>\n<p>Danh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.</li>\n<li>Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội</li>\n<li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam</li>\n<li>Đạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</li>\n</ul>\n<h4>Khám tư vấn tim mạch</h4>\n<ul>\n<li>Khó thở, Đau ngực, đau tim</li>\n<li>Tăng huyết áp, hạ huyết áp</li>\n<li>Rối loạn mỡ máu, cao huyết áp, chóng mặt</li>\n<li>Bệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ</li>\n<li>Cảm giác hồi hộp, tim đập nhanh</li>\n<li>Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến</li>\n<li>Đã đặt stent tim, nong động mạch vành</li>\n<li>Giãn tĩnh mạch chân</li>\n<li>...</li>\n</ul>\n', '\n### Tim mạch\n\n#### Bác sĩ Chuyên khoa Tiêu hóa\n\nDanh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:\n* Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.\n* Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội\n* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam\n* Đạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\n\n#### Khám tư vấn tim mạch\n\n* Khó thở, Đau ngực, đau tim\n* Tăng huyết áp, hạ huyết áp\n* Rối loạn mỡ máu, cao huyết áp, chóng mặt\n* Bệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ\n* Cảm giác hồi hộp, tim đập nhanh	   \n* Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến	   \n* Đã đặt stent tim, nong động mạch vành\n* Giãn tĩnh mạch chân	   \n* ...', '2024-01-09 23:22:47', '2024-01-09 23:22:47');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(5, 'Tai Mũi Họng', 'data:image/png;base64,', '<h3>Tim mạch</h3>\n<h4>Bác sĩ Chuyên khoa Tai Mũi Họng</h4>\n<p>Danh sách các bác sĩ uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà Nội</li>\n<li>Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...</li>\n</ul>\n<h4>Các bệnh Tai Mũi Họng</h4>\n<ul>\n<li>Ù tai, đau tai, chảy máu tai</li>\n<li>Thủng màng nhĩ, điếc đột ngột</li>\n<li>Viêm tai giữa</li>\n<li>Amidan, V.A</li>\n<li>Viêm xoang</li>\n<li>Nghẹt mũi</li>\n<li>Hay bị chảy máu cam</li>\n<li>Đau cổ họng, khó nuốt</li>\n<li>Ho kéo dài</li>\n<li>Ngủ ngáy</li>\n<li>...</li>\n</ul>\n', '\n### Tim mạch\n\n#### Bác sĩ Chuyên khoa Tai Mũi Họng\n\nDanh sách các bác sĩ uy tín đầu ngành tại Việt Nam:\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà Nội\n* Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...\n\n#### Các bệnh Tai Mũi Họng\n\n* Ù tai, đau tai, chảy máu tai\n* Thủng màng nhĩ, điếc đột ngột\n* Viêm tai giữa\n* Amidan, V.A\n* Viêm xoang\n* Nghẹt mũi\n* Hay bị chảy máu cam\n* Đau cổ họng, khó nuốt\n* Ho kéo dài\n* Ngủ ngáy\n* ...', '2024-01-09 23:24:08', '2024-01-12 02:36:10');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(6, 'Cột sống', 'data:image/png;base64,', '<h3>Cột sống</h3>\n<h4>Bác sĩ Chuyên khoa Cột sống</h4>\n<p>Danh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà Nội</li>\n<li>Các giáo sư, tiến sĩ, bác sĩ là giảng viên Đại học Y khoa Hà Nội, Học viện Quân Y.</li>\n<li>Các bác sĩ đã, đang công tác tại chuyên Khoa Thần Kinh, Cột sống, Xương Khớp - Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Trung ương Quân đội 108, Bệnh viện 103...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</li>\n</ul>\n<h4>Bệnh Thần kinh - Cột sống</h4>\n<ul>\n<li>Đau cột sống, đau thắt lưng</li>\n<li>Chấn thương cột sống</li>\n<li>Cột sống bị đau, sưng, cong, vẹo</li>\n<li>Đau mỏi cổ vai gáy, bả vai</li>\n<li>Đau tê mông xuống chân</li>\n<li>Phồng đĩa đệm</li>\n<li>Tê bì tay chân</li>\n<li>Thóa hóa đốt sống</li>\n<li>Thoái hóa L4, L5</li>\n<li>Thoát vị đĩa đệm</li>\n<li>Vôi hóa cột sống</li>\n<li>Xẹp cột sống</li>\n<li>...</li>\n</ul>\n', '\n### Cột sống\n\n#### Bác sĩ Chuyên khoa Cột sống\n\nDanh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam:\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà Nội\n* Các giáo sư, tiến sĩ, bác sĩ là giảng viên Đại học Y khoa Hà Nội, Học viện Quân Y.\n* Các bác sĩ đã, đang công tác tại chuyên Khoa Thần Kinh, Cột sống, Xương Khớp - Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Trung ương Quân đội 108, Bệnh viện 103...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\n\n#### Bệnh Thần kinh - Cột sống\n\n* Đau cột sống, đau thắt lưng\n* Chấn thương cột sống\n* Cột sống bị đau, sưng, cong, vẹo\n* Đau mỏi cổ vai gáy, bả vai\n* Đau tê mông xuống chân\n* Phồng đĩa đệm\n* Tê bì tay chân\n* Thóa hóa đốt sống\n* Thoái hóa L4, L5\n* Thoát vị đĩa đệm\n* Vôi hóa cột sống\n* Xẹp cột sống\n* ...', '2024-01-09 23:25:58', '2024-01-09 23:25:58');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(7, 'Y học Cổ truyền', 'data:image/png;base64,', '<h3>Y học Cổ truyền</h3>\n<h4>Bác sĩ Y học Cổ truyền giỏi</h4>\n<p>Danh sách các bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền</li>\n<li>Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..</li>\n</ul>\n<h4>Tư vấn, khám và điều trị các vấn đề:</h4>\n<ul>\n<li>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...</li>\n<li>Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...</li>\n<li>Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...</li>\n<li>Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...</li>\n</ul>\n', '\n### Y học Cổ truyền\n\n#### Bác sĩ Y học Cổ truyền giỏi\n\nDanh sách các bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền\n* Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..\n\n#### Tư vấn, khám và điều trị các vấn đề:\n\n* Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...\n* Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...\n* Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...\n* Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...\n\n', '2024-01-09 23:29:28', '2024-01-09 23:29:28');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(8, 'Châm cứu', 'data:image/png;base64,', '<h3>Châm cứu</h3>\n<h4>Bác sĩ Châm cứu giỏi</h4>\n<p>Bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền</li>\n<li>Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..</li>\n</ul>\n<h4>Tư vấn, khám và điều trị các vấn đề:</h4>\n<ul>\n<li>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...</li>\n<li>Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...</li>\n<li>Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...</li>\n<li>Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...</li>\n</ul>\n', '\n### Châm cứu\n\n#### Bác sĩ Châm cứu giỏi\n\nBác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyền\n* Các bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..\n\n#### Tư vấn, khám và điều trị các vấn đề:\n\n* Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...\n* Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...\n* Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...\n* Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...', '2024-01-09 23:30:30', '2024-01-09 23:30:30');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(9, 'Sản Phụ khoa', 'data:image/png;base64,', '<h3>Sản Phụ khoa</h3>\n<h4>Bác sĩ Sản phụ khoa</h4>\n<p>BookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa sản giỏi tại Hà Nội.</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Sản phụ khoa tại Hà Nội</li>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Phụ sản Trung ương, Bệnh viện Phụ sản Hà Nội, Khoa Sản - Bệnh viện Bạch Mai.</li>\n</ul>\n<h4>Khám và điều trị</h4>\n<ul>\n<li>Rối loạn kinh nguyệt, chậm kinh, đau bụng kinh</li>\n<li>Tắc hai vòi trứng, Đa nang buồng trứng, Chụp vòi trứng,</li>\n<li>Khám hiếm muộn, vô sinh</li>\n<li>Khám Phụ Khoa</li>\n<li>Khám thai sản</li>\n<li>Khám tiền hôn nhân, Tiền sinh</li>\n<li>Kiểm tra phụ khoa</li>\n<li>Loạn dưỡng vú</li>\n<li>Rong kinh kéo dài</li>\n<li>Siêu âm thai định kỳ</li>\n<li>Thai lưu</li>\n<li>U xơ tử cung, Viêm lộ tuyến</li>\n<li>...</li>\n</ul>\n', '\n### Sản Phụ khoa\n\n#### Bác sĩ Sản phụ khoa\n\nBookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa sản giỏi tại Hà Nội.\n*  Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Sản phụ khoa tại Hà Nội\n*  Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Phụ sản Trung ương, Bệnh viện Phụ sản Hà Nội, Khoa Sản - Bệnh viện Bạch Mai.\n\n#### Khám và điều trị\n\n* Rối loạn kinh nguyệt, chậm kinh, đau bụng kinh   \n* Tắc hai vòi trứng, Đa nang buồng trứng, Chụp vòi trứng, 	      \n* Khám hiếm muộn, vô sinh	   \n* Khám Phụ Khoa	   \n* Khám thai sản	   \n* Khám tiền hôn nhân, Tiền sinh	   \n* Kiểm tra phụ khoa	   \n* Loạn dưỡng vú	   \n* Rong kinh kéo dài	   \n* Siêu âm thai định kỳ	   \n* Thai lưu\n* U xơ tử cung, Viêm lộ tuyến\n* ...', '2024-01-09 23:31:52', '2024-01-09 23:31:52');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(10, 'Siêu âm thai', 'data:image/png;base64,', '<h3>Siêu âm thai</h3>\n<h4>Bác sĩ Siêu âm thai</h4>\n<p>BookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa sản - siêu âm thai giỏi tại Hà Nội.</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Phụ sản Trung ương, Bệnh viện Phụ sản Hà Nội, Khoa Sản - Bệnh viện Bạch Mai.</li>\n</ul>\n<h4>Khám và điều trị</h4>\n<p>Dưới đây là một số vấn đề thường gặp mà các bác sĩ siêu âm thai thường khám và điều trị</p>\n<ul>\n<li>Khám thai sản</li>\n<li>Khám thai lần đầu</li>\n<li>Siêu âm thai định kỳ</li>\n<li>Siêu âm thai tuần thứ 12</li>\n<li>Siêu âm thai tuần thứ 16</li>\n<li>Siêu âm thai tuần thứ 18</li>\n<li>Siêu âm thai tuần thứ 22</li>\n</ul>\n', '\n### Siêu âm thai\n\n#### Bác sĩ Siêu âm thai\n\nBookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa sản - siêu âm thai giỏi tại Hà Nội.\n*  Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Phụ sản Trung ương, Bệnh viện Phụ sản Hà Nội, Khoa Sản - Bệnh viện Bạch Mai.\n\n#### Khám và điều trị\nDưới đây là một số vấn đề thường gặp mà các bác sĩ siêu âm thai thường khám và điều trị\n* Khám thai sản\n* Khám thai lần đầu\n* Siêu âm thai định kỳ\n* Siêu âm thai tuần thứ 12	\n* Siêu âm thai tuần thứ 16	\n* Siêu âm thai tuần thứ 18	\n* Siêu âm thai tuần thứ 22', '2024-01-09 23:34:57', '2024-01-09 23:34:57');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(11, 'Nhi khoa', 'data:image/png;base64,', '<h3>Nhi khoa</h3>\n<h4>Bác sĩ chuyên khoa Nhi</h4>\n<p>Danh sách bác sĩ chuyên khoa Nhi giỏi:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội</li>\n<li>Các giảng viên đã và đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như: Bệnh viện Nhi Trung ương, Khoa Nhi - Bệnh viện Bạch Mai.</li>\n</ul>\n<h4>Khám và điều trị</h4>\n<ul>\n<li>Bệnh lý sơ sinh</li>\n<li>Bệnh tiêu hóa</li>\n<li>Bệnh tuần hoàn</li>\n<li>Bệnh hô hấp</li>\n<li>Bệnh huyết học</li>\n<li>Bệnh thận Tiết niệu</li>\n<li>Bệnh thần kinh</li>\n<li>Bệnh ngoài da</li>\n<li>Bệnh xương khớp</li>\n</ul>\n', '\n### Nhi khoa\n\n#### Bác sĩ chuyên khoa Nhi \n\nDanh sách bác sĩ chuyên khoa Nhi giỏi:\n*  Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội\n* Các giảng viên đã và đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như: Bệnh viện Nhi Trung ương, Khoa Nhi - Bệnh viện Bạch Mai.\n\n#### Khám và điều trị\n\n\n* Bệnh lý sơ sinh\n* Bệnh tiêu hóa\n* Bệnh tuần hoàn\n* Bệnh hô hấp\n* Bệnh huyết học\n* Bệnh thận Tiết niệu\n* Bệnh thần kinh\n* Bệnh ngoài da\n* Bệnh xương khớp', '2024-01-09 23:36:29', '2024-01-09 23:36:29');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(12, 'Da liễu', 'data:image/png;base64,', '<h3>Da liễu</h3>\n<h4>Bác sĩ Chuyên khoa Da liễu</h4>\n<p>BookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa da liễu giỏi tại Hà Nội.</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Da liễu Trung ương, Bệnh viện Da liễu Hà Nội</p>\n<h4>Khám và điều trị</h4>\n<ul>\n<li>Bệnh vẩy nến, Da khô, Ngứa da</li>\n<li>Rám tàn nhang</li>\n<li>Mụn cóc sinh dục</li>\n<li>Nấm cơ thể, Nấm da đầu</li>\n<li>Nấm móng tay, móng chân</li>\n<li>Rụng tóc, hói đầu</li>\n<li>Viêm da dị ứng, Viêm da tiếp xúc, Viêm da tiết bã</li>\n<li>Viêm nang lông</li>\n<li>Xơ cứng bì</li>\n<li>Zona thần kinh</li>\n</ul>\n', '\n### Da liễu\n\n#### Bác sĩ Chuyên khoa Da liễu\n\nBookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa da liễu giỏi tại Hà Nội.\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Da liễu Trung ương, Bệnh viện Da liễu Hà Nội\n\n#### Khám và điều trị\n\n* Bệnh vẩy nến, Da khô, Ngứa da\n* Rám tàn nhang\n* Mụn cóc sinh dục\n* Nấm cơ thể, Nấm da đầu\n* Nấm móng tay, móng chân\n* Rụng tóc, hói đầu\n* Viêm da dị ứng, Viêm da tiếp xúc, Viêm da tiết bã\n* Viêm nang lông\n* Xơ cứng bì\n* Zona thần kinh', '2024-01-09 23:37:32', '2024-01-09 23:37:32');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(13, 'Bệnh Viêm gan', 'data:image/png;base64,', '<h3>Da liễu</h3>\n<h4>Bác sĩ Chuyên khoa Da liễu</h4>\n<p>BookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa da liễu giỏi tại Hà Nội.</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Da liễu Trung ương, Bệnh viện Da liễu Hà Nội</p>\n<h4>Khám và điều trị</h4>\n<ul>\n<li>Bệnh vẩy nến, Da khô, Ngứa da</li>\n<li>Rám tàn nhang</li>\n<li>Mụn cóc sinh dục</li>\n<li>Nấm cơ thể, Nấm da đầu</li>\n<li>Nấm móng tay, móng chân</li>\n<li>Rụng tóc, hói đầu</li>\n<li>Viêm da dị ứng, Viêm da tiếp xúc, Viêm da tiết bã</li>\n<li>Viêm nang lông</li>\n<li>Xơ cứng bì</li>\n<li>Zona thần kinh</li>\n</ul>\n', '\n### Da liễu\n\n#### Bác sĩ Chuyên khoa Da liễu\n\nBookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa da liễu giỏi tại Hà Nội.\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Da liễu Trung ương, Bệnh viện Da liễu Hà Nội\n\n#### Khám và điều trị\n\n* Bệnh vẩy nến, Da khô, Ngứa da\n* Rám tàn nhang\n* Mụn cóc sinh dục\n* Nấm cơ thể, Nấm da đầu\n* Nấm móng tay, móng chân\n* Rụng tóc, hói đầu\n* Viêm da dị ứng, Viêm da tiếp xúc, Viêm da tiết bã\n* Viêm nang lông\n* Xơ cứng bì\n* Zona thần kinh', '2024-01-09 23:39:35', '2024-01-09 23:39:35');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(14, 'Sức khỏe tâm thần', 'data:image/png;base64,', '<h3>Sức khỏe tâm thần</h3>\n<h4>Bác sĩ về Sức khỏe Tâm thần giỏi</h4>\n<p>Danh sách các giáo sư, bác sĩ chuyên khoa Sức khỏe tâm thần giỏi:</p>\n<ul>\n<li>Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Sức khỏe tâm thần đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Tâm thần Trung ương, Bệnh viện Chợ Rẫy, Bệnh viện Lão khoa...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.</li>\n</ul>\n<h4>Bác sĩ khám -Tư vấn - Điều trị</h4>\n<ul>\n<li>Mất ngủ, Rối loạn giấc ngủ</li>\n<li>Trầm cảm, Căng thẳng, stress</li>\n<li>Tâm thần phân liệt, Bệnh hoang tưởng</li>\n<li>Rối loạn cảm xúc , Rối loạn căng thẳng sau chấn thương tâm lý</li>\n<li>Rối loạn lo âu, Rối loạn lưỡng cực, Rối loạn nhân cách</li>\n<li>Tư vấn và tạo điều kiện cho bệnh nhân tái thích ứng xã hội</li>\n</ul>\n<h4>Một số triệu chứng, biểu hiện</h4>\n<ul>\n<li>Ảo giác, Hoang tưởng, Nói cười một mình</li>\n<li>Bi quan, Bồn chồn, Buồn rầu, Hoảng hốt</li>\n<li>Khó tập trung tâm trí, Nhầm lẫn tư duy</li>\n<li>Lo âu, Lo lắng</li>\n<li>Rối loạn giấc ngủ</li>\n<li>Sợ hãi, Sợ một mình, Sợ nơi đông người</li>\n<li>Xa lánh mọi người, Ý nghĩ kì lạ</li>\n</ul>\n', '\n### Sức khỏe tâm thần\n\n#### Bác sĩ về Sức khỏe Tâm thần giỏi\nDanh sách các giáo sư, bác sĩ chuyên khoa Sức khỏe tâm thần giỏi:\n\n* Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Sức khỏe tâm thần đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Tâm thần Trung ương, Bệnh viện Chợ Rẫy, Bệnh viện Lão khoa...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.\n\n#### Bác sĩ khám -Tư vấn - Điều trị\n\n* Mất ngủ, Rối loạn giấc ngủ\n* Trầm cảm, Căng thẳng, stress\n* Tâm thần phân liệt, Bệnh hoang tưởng\n* Rối loạn cảm xúc , Rối loạn căng thẳng sau chấn thương tâm lý \n* Rối loạn lo âu, Rối loạn lưỡng cực, Rối loạn nhân cách\n* Tư vấn và tạo điều kiện cho bệnh nhân tái thích ứng xã hội\n\n#### Một số triệu chứng, biểu hiện\n* Ảo giác, Hoang tưởng, Nói cười một mình\n* Bi quan, Bồn chồn, Buồn rầu, Hoảng hốt\n* Khó tập trung tâm trí, Nhầm lẫn tư duy\n* Lo âu, Lo lắng\n* Rối loạn giấc ngủ\n* Sợ hãi, Sợ một mình, Sợ nơi đông người\n* Xa lánh mọi người, Ý nghĩ kì lạ', '2024-01-10 00:03:17', '2024-01-10 00:03:17');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(15, 'Dị ứng miễn dịch', 'data:image/png;base64,', '<h3>Dị ứng miễn dịch</h3>\n<h4>Bác sĩ Dị ứng Miễn dịch giỏi</h4>\n<p>Danh sách các giáo sư, bác sĩ chuyên khoa Dị ứng miễn dịch giỏi:</p>\n<ul>\n<li>Các bác sĩ uy tín đầu ngành chuyên khoa Dị ứng miễn dịch đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Đại học Y dược 1 TP.HCM, Bệnh viện E,...</li>\n<li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội dị ứng miễn dịch châu Âu, Hội Hen – Dị ứng - Miễn dịch Lâm sàng TPHCM...</li>\n</ul>\n<h4>Dị ứng</h4>\n<p>Dị ứng thuốc, Phản ứng quá mẫn với Vacxin\nHen phế quản\nMày đay, Dị ứng thức ăn, Dị ứng do côn trùng đốt\nViêm mũi dị ứng, Viêm kết mạc dị ứng, Viêm da cơ địa</p>\n<h4>Miễn dịch</h4>\n<ul>\n<li>Lupus ban đỏ hệ thống, Xơ cứng bì hệ thống</li>\n<li>Viêm da cơ, viêm đa cơ, Bệnh mô liên kết hỗn hợp</li>\n<li>Hội chứng kháng Phospholipid</li>\n<li>Viêm mạch Schoenlein-Henoch, Viêm gan tự miễn</li>\n</ul>\n', '\n### Dị ứng miễn dịch\n\n#### Bác sĩ Dị ứng Miễn dịch giỏi\nDanh sách các giáo sư, bác sĩ chuyên khoa Dị ứng miễn dịch giỏi:\n* Các bác sĩ uy tín đầu ngành chuyên khoa Dị ứng miễn dịch đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Đại học Y dược 1 TP.HCM, Bệnh viện E,...\n* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội dị ứng miễn dịch châu Âu, Hội Hen – Dị ứng - Miễn dịch Lâm sàng TPHCM...\n\n#### Dị ứng\n\nDị ứng thuốc, Phản ứng quá mẫn với Vacxin\nHen phế quản\nMày đay, Dị ứng thức ăn, Dị ứng do côn trùng đốt\nViêm mũi dị ứng, Viêm kết mạc dị ứng, Viêm da cơ địa\n\n#### Miễn dịch\n* Lupus ban đỏ hệ thống, Xơ cứng bì hệ thống\n* Viêm da cơ, viêm đa cơ, Bệnh mô liên kết hỗn hợp\n* Hội chứng kháng Phospholipid\n* Viêm mạch Schoenlein-Henoch, Viêm gan tự miễn', '2024-01-10 00:05:02', '2024-01-10 00:05:02');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(16, 'Hô hấp - Phổi', 'data:image/png;base64,', '<h3>Hô hấp - Phổi</h3>\n<h4>Bác sĩ Chuyên khoa Hô hấp - Phổi</h4>\n<p>Danh sách các bác sĩ chuyên khoa Hô hấp - Phổi giỏi:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện, phòng khám lớn  như: Bệnh viện Đại học Y dược, Phòng khám Phổi Sài Gòn, Bệnh viện Phổi Trung ương,...</li>\n<li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Phổi Việt Nam, Hội Hô Hấp Việt Nam...</li>\n</ul>\n<h4>Khám và điều trị</h4>\n<ul>\n<li>Lao</li>\n<li>Lao kháng thuốc</li>\n<li>Hen</li>\n<li>COPD</li>\n<li>Các bệnh Phổi nghề nghiệp</li>\n<li>Các bệnh hô hấp</li>\n</ul>\n', '\n### Hô hấp - Phổi\n\n#### Bác sĩ Chuyên khoa Hô hấp - Phổi\nDanh sách các bác sĩ chuyên khoa Hô hấp - Phổi giỏi:\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện, phòng khám lớn  như: Bệnh viện Đại học Y dược, Phòng khám Phổi Sài Gòn, Bệnh viện Phổi Trung ương,...\n* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Phổi Việt Nam, Hội Hô Hấp Việt Nam...\n\n#### Khám và điều trị\n\n* Lao\n* Lao kháng thuốc\n* Hen\n* COPD\n* Các bệnh Phổi nghề nghiệp\n* Các bệnh hô hấp', '2024-01-10 00:17:59', '2024-01-10 00:17:59');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(17, 'Ngoại thần kinh', 'data:image/png;base64,', '<h3>Ngoại thần kinh</h3>\n<h4>Bác sĩ Ngoại Thần kinh giỏi</h4>\n<p>Danh sách các giáo sư, bác sĩ chuyên khoa Ngoại Thần kinh giỏi:</p>\n<ul>\n<li>Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Ngoại Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện 108, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện Đại học Y Hà Nội...</li>\n<li>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.</li>\n</ul>\n<h4>Khám bệnh chuyên khoa Ngoại Thần kinh</h4>\n<ul>\n<li>U não</li>\n<li>Bệnh lý về chấn thương sọ não</li>\n<li>Não úng thủy</li>\n<li>Đau dây thần kinh</li>\n<li>Dị dạng động tĩnh mạch</li>\n<li>Dị dạng mạch máu não</li>\n<li>Túi phình mạch máu não</li>\n<li>Khuyết sọ</li>\n<li>U dây thần kinh ngoại biên</li>\n<li>...</li>\n</ul>\n', '\n### Ngoại thần kinh\n\n#### Bác sĩ Ngoại Thần kinh giỏi\nDanh sách các giáo sư, bác sĩ chuyên khoa Ngoại Thần kinh giỏi:\n* Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Ngoại Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện 108, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện Đại học Y Hà Nội...\n* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.\n\n#### Khám bệnh chuyên khoa Ngoại Thần kinh\n\n* U não\n* Bệnh lý về chấn thương sọ não\n* Não úng thủy\n* Đau dây thần kinh\n* Dị dạng động tĩnh mạch\n* Dị dạng mạch máu não\n* Túi phình mạch máu não\n* Khuyết sọ\n* U dây thần kinh ngoại biên\n* ...', '2024-01-10 00:19:12', '2024-01-10 00:19:12');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(18, 'Nam học', 'data:image/png;base64,', '<h3>Nam học</h3>\n<h4>Bác sĩ Chuyên khoa Nam học</h4>\n<p>Danh sách bác sĩ Nam học uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Nam học tại Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh Viện Việt Đức, Bệnh viện Xanh-pôn,...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...</li>\n</ul>\n<h4>Tư vấn, khám và điều trị các Bệnh chuyên khoa Nam học</h4>\n<ul>\n<li>Mãn dục nam giới, Suy sinh dục nam</li>\n<li>Viêm đường tiết niệu – sinh dục</li>\n<li>Viêm nhiễm: viêm bao quy đầu, viêm tinh hoàn</li>\n<li>Bệnh lý bao quy đầu: hẹp, dài bao quy đầu</li>\n<li>Rối loạn chức năng sinh dục: xuất tinh sớm, rối loạn cương dương, rối loạn xuất tinh, Xuất tinh kèm máu…</li>\n<li>Bệnh xã hội: lậu, giang mai, sùi mào gà, herpes…</li>\n<li>Các trường hợp sẩn ngứa, sẩn cục cơ quan sinh dục</li>\n<li>Xuất tinh ngược, Viêm tinh hoàn</li>\n<li>Các bệnh lý liên quan đến hiếm muộn</li>\n<li>Tinh hoàn ẩn</li>\n<li>...</li>\n</ul>\n', '\n### Nam học\n\n#### Bác sĩ Chuyên khoa Nam học\nDanh sách bác sĩ Nam học uy tín đầu ngành tại Việt Nam:\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Nam học tại Hà Nội\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh Viện Việt Đức, Bệnh viện Xanh-pôn,...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...\n\n#### Tư vấn, khám và điều trị các Bệnh chuyên khoa Nam học\n\n* Mãn dục nam giới, Suy sinh dục nam\n* Viêm đường tiết niệu – sinh dục\n* Viêm nhiễm: viêm bao quy đầu, viêm tinh hoàn\n* Bệnh lý bao quy đầu: hẹp, dài bao quy đầu\n* Rối loạn chức năng sinh dục: xuất tinh sớm, rối loạn cương dương, rối loạn xuất tinh, Xuất tinh kèm máu…\n* Bệnh xã hội: lậu, giang mai, sùi mào gà, herpes…\n* Các trường hợp sẩn ngứa, sẩn cục cơ quan sinh dục\n* Xuất tinh ngược, Viêm tinh hoàn\n* Các bệnh lý liên quan đến hiếm muộn\n* Tinh hoàn ẩn\n* ...', '2024-01-10 00:20:13', '2024-01-10 00:20:13');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(19, 'Chuyên khoa Mắt', 'data:image/png;base64,', '<h3>Chuyên khoa Mắt</h3>\n<h4>Bác sĩ Chuyên khoa Mắt</h4>\n<p>Hệ thống BookingCare cung cấp thông tin và lịch khám của các bác sĩ uy tín đầu ngành tại Việt Nam.</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Mắt tại Hà Nội.</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Mắt Trung ương, Viện Y học Hàng không - Không quân, Bệnh viện Mắt Quốc tế DND...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...</li>\n</ul>\n<h4>Các bệnh về mắt</h4>\n<ul>\n<li>Tật khúc xạ</li>\n<li>Cận thị</li>\n<li>Nhược thị</li>\n<li>Viễn thị</li>\n<li>Lão thị</li>\n<li>Loạn thị</li>\n</ul>\n<h4>Các rối loạn về mắt</h4>\n<ul>\n<li>Hội chứng khô mắt</li>\n<li>Rối loạn ở hốc mắt</li>\n<li>Rối loạn tuyến lệ</li>\n<li>Tăng nhãn áp</li>\n</ul>\n<h4>Các bệnh lí khác về mắt</h4>\n<ul>\n<li>Lác mắt</li>\n<li>Viêm giác mạc</li>\n<li>Đục thủy tinh thể</li>\n<li>Dịch kính võng mạc</li>\n<li>Bong võng mạc</li>\n<li>Bệnh thoái hóa hoàng điểm tuổi già</li>\n</ul>\n', '\n### Chuyên khoa Mắt\n\n#### Bác sĩ Chuyên khoa Mắt\nHệ thống BookingCare cung cấp thông tin và lịch khám của các bác sĩ uy tín đầu ngành tại Việt Nam.\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Mắt tại Hà Nội.\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Mắt Trung ương, Viện Y học Hàng không - Không quân, Bệnh viện Mắt Quốc tế DND...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...\n\n#### Các bệnh về mắt\n* Tật khúc xạ\n* Cận thị\n* Nhược thị\n* Viễn thị\n* Lão thị\n* Loạn thị\n#### Các rối loạn về mắt\n* Hội chứng khô mắt\n* Rối loạn ở hốc mắt\n* Rối loạn tuyến lệ\n* Tăng nhãn áp\n#### Các bệnh lí khác về mắt\n* Lác mắt\n* Viêm giác mạc\n* Đục thủy tinh thể\n* Dịch kính võng mạc\n* Bong võng mạc\n* Bệnh thoái hóa hoàng điểm tuổi già', '2024-01-10 00:22:13', '2024-01-10 00:22:13');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(20, 'Thận - Tiết niệu', 'data:image/png;base64,', '<h3>Thận - Tiết niệu</h3>\n<h4>Bác sĩ Thận - Tiết niệu giỏi</h4>\n<ul>\n<li>Hệ thống BookingCare cung cấp thông tin và lịch khám của các bác sĩ uy tín đầu ngành tại Việt Nam.</li>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Thận - Tiết niệu tại Hà Nội.</li>\n<li>Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội.</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh viện Việt Đức,...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...</li>\n</ul>\n<h4>Bệnh về Thận - Tiết niệu</h4>\n<ul>\n<li>Các bệnh về tiền liệt tuyến, phì đại tiền liệt tuyến, đi tiểu ra máu</li>\n<li>Thận đa nang</li>\n<li>Ung thư tuyến tiền liệt</li>\n<li>Viêm bàng quang</li>\n<li>Tiểu không tự chủ</li>\n<li>Ung thư bàng quang</li>\n<li>Sỏi bàng quang</li>\n<li>Sỏi thận</li>\n<li>Viêm đài bể thận</li>\n<li>U nang thận</li>\n<li>Áp xe quanh thận</li>\n<li>Vôi hóa tuyến tiền liệt</li>\n</ul>\n', '\n### Thận - Tiết niệu\n\n#### Bác sĩ Thận - Tiết niệu giỏi\n* Hệ thống BookingCare cung cấp thông tin và lịch khám của các bác sĩ uy tín đầu ngành tại Việt Nam.\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Thận - Tiết niệu tại Hà Nội.\n* Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội.\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh viện Việt Đức,...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...\n\n#### Bệnh về Thận - Tiết niệu\n* Các bệnh về tiền liệt tuyến, phì đại tiền liệt tuyến, đi tiểu ra máu\n* Thận đa nang \n* Ung thư tuyến tiền liệt\n* Viêm bàng quang \n* Tiểu không tự chủ \n* Ung thư bàng quang \n* Sỏi bàng quang\n* Sỏi thận\n* Viêm đài bể thận \n* U nang thận \n* Áp xe quanh thận \n* Vôi hóa tuyến tiền liệt', '2024-01-10 00:23:13', '2024-01-10 00:23:13');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(21, 'Nội khoa', 'data:image/png;base64,', '<h3>Nội khoa</h3>\n<h4>Bác sĩ chuyên khoa Nội</h4>\n<p>BookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa Nội giỏi tại Hà Nội.</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Bạch Mai, Bệnh Viện Quân Y 103...</p>\n<h4>Khám và điều trị</h4>\n<p>Bệnh nhân nên đặt khám với các bác sĩ nếu gặp các triệu chứng bên dưới đây:</p>\n<ul>\n<li>Kiểm tra sức khỏe</li>\n<li>Chóng mặt</li>\n<li>Mêt mỏi</li>\n<li>Hoa mắt</li>\n<li>Kém ăn</li>\n<li>Giảm sút cân</li>\n<li>Khó ngủ</li>\n<li>Đau đầu</li>\n<li>Ngộ độc rượu</li>\n<li>Ngộ độc thức ăn</li>\n<li>Dị ứng</li>\n<li>Viêm da dị ứng</li>\n<li>Dị ứng thực phẩm</li>\n<li>Dị ứng côn trùng</li>\n<li>Dị ứng vật nuôi</li>\n<li>Nổi mề đay</li>\n<li>Rối loạn miễn dịch</li>\n<li>Rối loạn chuyển hóa\nNgoài những vấn đề nêu trên, bệnh nhân có thể liên hệ với chúng tôi để được hỗ trợ, sắp xếp lịch khám phù hợp.</li>\n</ul>\n', '\n### Nội khoa\n\n#### ﻿Bác sĩ chuyên khoa Nội\nBookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa Nội giỏi tại Hà Nội.\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Bạch Mai, Bệnh Viện Quân Y 103...\n#### Khám và điều trị\nBệnh nhân nên đặt khám với các bác sĩ nếu gặp các triệu chứng bên dưới đây:\n* Kiểm tra sức khỏe\n* Chóng mặt\n* Mêt mỏi\n* Hoa mắt\n* Kém ăn\n* Giảm sút cân\n* Khó ngủ\n* Đau đầu\n* Ngộ độc rượu\n* Ngộ độc thức ăn\n* Dị ứng\n* Viêm da dị ứng\n* Dị ứng thực phẩm\n* Dị ứng côn trùng\n* Dị ứng vật nuôi\n* Nổi mề đay\n* Rối loạn miễn dịch\n* Rối loạn chuyển hóa\nNgoài những vấn đề nêu trên, bệnh nhân có thể liên hệ với chúng tôi để được hỗ trợ, sắp xếp lịch khám phù hợp.', '2024-01-10 00:24:52', '2024-01-10 00:24:52');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(22, 'Tiểu đường - Nội tiết', 'data:image/png;base64,', '<h3>Tiểu đường - Nội tiết</h3>\n<h4>Bác sĩ Nội tiết</h4>\n<p>Danh sách bác sĩ chuyên khoa Nội tiết giỏi:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Bạch Mai, Bệnh viện Quân Y 103, Bệnh viện Nội tiết Trung ương, Bệnh viện Đại học Y Hà Nội.</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.</li>\n</ul>\n<h4>Tư vấn, khám và điều trị</h4>\n<ul>\n<li>Bướu cổ</li>\n<li>Cường cận giáp</li>\n<li>Đái tháo đường</li>\n<li>Suy giáp, Cường giáp</li>\n<li>Suy tuyến yên,U tuyến yên</li>\n<li>Tăng đường huyết bệnh tiểu đường</li>\n<li>Tiền tiểu đường</li>\n<li>Tiểu đường</li>\n<li>Tiểu đường tuýp 1, 2</li>\n<li>Ung thư tuyến giáp</li>\n</ul>\n', '\n### Tiểu đường - Nội tiết\n\n#### Bác sĩ Nội tiết\nDanh sách bác sĩ chuyên khoa Nội tiết giỏi:\n\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Bạch Mai, Bệnh viện Quân Y 103, Bệnh viện Nội tiết Trung ương, Bệnh viện Đại học Y Hà Nội.\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.\n#### Tư vấn, khám và điều trị\n* Bướu cổ\n* Cường cận giáp\n* Đái tháo đường\n* Suy giáp, Cường giáp\n* Suy tuyến yên,U tuyến yên\n* Tăng đường huyết bệnh tiểu đường\n* Tiền tiểu đường\n* Tiểu đường\n* Tiểu đường tuýp 1, 2\n* Ung thư tuyến giáp', '2024-01-10 00:27:26', '2024-01-10 00:27:26');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(23, 'Phục hồi chức năng', 'data:image/png;base64,', '<h3>Tiểu đường - Nội tiết</h3>\n<h4>Bác sĩ  Phục hồi chức năng giỏi</h4>\n<p>Danh sách bác sĩ chuyên khoa Phục hồi chức năng giỏi:</p>\n<ul>\n<li>Các bác sĩ uy tín đầu ngành chuyên khoa Phục hồi chức năng đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Đại học Y Hà Nội, Bệnh viện Thanh Nhàn,...</li>\n<li>Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm</li>\n</ul>\n<h4>Khám và điều trị Phục hồi chức năng</h4>\n<h4>Phục hồi chức năng cho người lớn</h4>\n<ul>\n<li>Phục hồi chức năng sau chấn thương chỉnh hình: Sau gãy xương cẳng chân, vỡ bánh chè, gãy xương cánh tay, gãy mỏm khuỷu, gãy các xương bàn ngón tay...</li>\n<li>Điều trị nội khoa: điều trị thoát vị đĩa đệm cột sống, hội chứng cổ vai gáy, viêm quanh khớp vai, thoái hóa khớp, hội chứng ống cổ tay, viêm gân gấp, viêm điểm bám gân</li>\n<li>Các bệnh lý thần kinh trung ương: liệt nửa người do tai biến mạch máu não, chấn thương sọ não, đau đầu kéo dài, mất ngủ mạn tính, rối loạn tiền đình...</li>\n</ul>\n<h4>Phục hồi chức năng cho trẻ em</h4>\n<ul>\n<li>Âm ngữ trị liệu cho trẻ chậm phát triển trí tuệ, chậm nói, nói ngọng, nói lắp, các loại nói khó, tự kỷ, tăng động, giảm chú ý</li>\n<li>Mất giọng, khàn tiếng sau cắt, phẫu thuật thanh quản, giọng nhi hoá, rối loạn giọng</li>\n<li>Thất ngôn sau tai biến mạch máu não</li>\n<li>Khám, điều trị bàn chân bẹt, chân khoèo, chân chữ O, chữ X</li>\n<li>Dị tật bẩm sinh về vận động,  Điều trị trẻ bị vẹo cột sống</li>\n<li>Điều trị trật khớp háng, Điều trị trẻ vẹo cổ, thắt lưng</li>\n<li>Điều trị trẻ mắc Down, Chữa trẻ chậm phát triển trí tuệ</li>\n</ul>\n', '\n### Tiểu đường - Nội tiết\n\n#### Bác sĩ  Phục hồi chức năng giỏi\nDanh sách bác sĩ chuyên khoa Phục hồi chức năng giỏi:\n\n* Các bác sĩ uy tín đầu ngành chuyên khoa Phục hồi chức năng đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Đại học Y Hà Nội, Bệnh viện Thanh Nhàn,...\n* Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm\n\n#### Khám và điều trị Phục hồi chức năng\n#### Phục hồi chức năng cho người lớn\n* Phục hồi chức năng sau chấn thương chỉnh hình: Sau gãy xương cẳng chân, vỡ bánh chè, gãy xương cánh tay, gãy mỏm khuỷu, gãy các xương bàn ngón tay...\n* Điều trị nội khoa: điều trị thoát vị đĩa đệm cột sống, hội chứng cổ vai gáy, viêm quanh khớp vai, thoái hóa khớp, hội chứng ống cổ tay, viêm gân gấp, viêm điểm bám gân\n* Các bệnh lý thần kinh trung ương: liệt nửa người do tai biến mạch máu não, chấn thương sọ não, đau đầu kéo dài, mất ngủ mạn tính, rối loạn tiền đình...\n\n#### Phục hồi chức năng cho trẻ em\n* Âm ngữ trị liệu cho trẻ chậm phát triển trí tuệ, chậm nói, nói ngọng, nói lắp, các loại nói khó, tự kỷ, tăng động, giảm chú ý\n* Mất giọng, khàn tiếng sau cắt, phẫu thuật thanh quản, giọng nhi hoá, rối loạn giọng\n* Thất ngôn sau tai biến mạch máu não\n* Khám, điều trị bàn chân bẹt, chân khoèo, chân chữ O, chữ X\n* Dị tật bẩm sinh về vận động,  Điều trị trẻ bị vẹo cột sống\n* Điều trị trật khớp háng, Điều trị trẻ vẹo cổ, thắt lưng\n* Điều trị trẻ mắc Down, Chữa trẻ chậm phát triển trí tuệ', '2024-01-10 00:30:27', '2024-01-10 00:30:27');
INSERT INTO "specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(24, 'Chụp Cộng hưởng từ', 'data:image/png;base64,', '<h3>Chụp Cộng hưởng từ</h3>\n<h4>Kỹ thuật Chụp cộng hưởng từ (MRI)</h4>\n<ul>\n<li>Chụp cộng hưởng từ MRI là một kỹ thuật chẩn đoán hình ảnh hiện đại trong y học sử dụng từ trường và sóng radio.</li>\n<li>Hình ảnh chụp cộng hưởng từ MRI có độ tương phản cao, chi tiết giải phẫu tốt cho phép phát hiện chính xác các tổn thương hình thái, cấu trúc các bộ phận trong cơ thể.</li>\n<li>Khả năng tái tạo hình ảnh 3D, không có tác dụng phụ như X quang hoặc CT-Scanner nên ngày càng được chỉ định rộng rãi cho nhiều ứng dụng chuyên khoa khác nhau.</li>\n</ul>\n<h4>Các dịch vụ chụp Cộng hưởng từ</h4>\n<ul>\n<li>Chụp cộng hưởng từ cổ chân</li>\n<li>Chụp cộng hưởng từ cổ tay</li>\n<li>Chụp cộng hưởng từ cột sống</li>\n<li>Chụp cộng hưởng từ cột sống lưng</li>\n<li>Chụp cộng hưởng từ gan mật</li>\n<li>Chụp cộng hưởng từ gối</li>\n<li>Chụp cộng hưởng từ háng</li>\n<li>Chụp cộng hưởng từ hầu họng</li>\n<li>Chụp cộng hưởng từ hốc mắt</li>\n<li>Chụp cộng hưởng từ khớp vai</li>\n<li>Chụp cộng hưởng từ não</li>\n<li>Chụp cộng hưởng từ phần mềm</li>\n<li>Chụp cộng hưởng từ thắt lưng</li>\n<li>Chụp cộng hưởng từ tiểu khung</li>\n<li>Chụp cộng hưởng từ toàn thân</li>\n<li>Chụp cộng hưởng từ tuyến yên</li>\n<li>Chụp cổng hưởng từ vú</li>\n<li>Chụp MRI các phần mềm</li>\n<li>Chụp MRI cổ chân</li>\n<li>Chụp MRI cổ tay</li>\n<li>Chụp MRI cột sống cổ</li>\n<li>Chụp MRI cột sống lưng</li>\n<li>Chụp MRI cột sống thắt lưng</li>\n<li>Chụp MRI gan mật</li>\n<li>Chụp MRI gối</li>\n<li>Chụp MRI háng</li>\n<li>Chụp MRI hầu họng</li>\n<li>Chụp MRI hốc mắt</li>\n<li>Chụp MRI khớp vai</li>\n<li>Chụp MRI sọ não</li>\n<li>Chụp MRI Tiểu khung</li>\n<li>Chụp MRI toàn thân</li>\n<li>Chụp MRI tuyến yên</li>\n<li>Chụp MRI vú 2 bên</li>\n<li>Thuốc đối quang từ</li>\n</ul>\n', '\n### Chụp Cộng hưởng từ\n\n#### Kỹ thuật Chụp cộng hưởng từ (MRI)  \n* Chụp cộng hưởng từ MRI là một kỹ thuật chẩn đoán hình ảnh hiện đại trong y học sử dụng từ trường và sóng radio.\n* Hình ảnh chụp cộng hưởng từ MRI có độ tương phản cao, chi tiết giải phẫu tốt cho phép phát hiện chính xác các tổn thương hình thái, cấu trúc các bộ phận trong cơ thể.\n* Khả năng tái tạo hình ảnh 3D, không có tác dụng phụ như X quang hoặc CT-Scanner nên ngày càng được chỉ định rộng rãi cho nhiều ứng dụng chuyên khoa khác nhau.\n\n#### Các dịch vụ chụp Cộng hưởng từ\n* Chụp cộng hưởng từ cổ chân	   \n* Chụp cộng hưởng từ cổ tay	   \n* Chụp cộng hưởng từ cột sống	   \n* Chụp cộng hưởng từ cột sống lưng	   \n* Chụp cộng hưởng từ gan mật	   \n* Chụp cộng hưởng từ gối	   \n* Chụp cộng hưởng từ háng	   \n* Chụp cộng hưởng từ hầu họng	   \n* Chụp cộng hưởng từ hốc mắt	   \n* Chụp cộng hưởng từ khớp vai	   \n* Chụp cộng hưởng từ não	   \n* Chụp cộng hưởng từ phần mềm	   \n* Chụp cộng hưởng từ thắt lưng	   \n* Chụp cộng hưởng từ tiểu khung	   \n* Chụp cộng hưởng từ toàn thân	   \n* Chụp cộng hưởng từ tuyến yên	   \n* Chụp cổng hưởng từ vú	   \n* Chụp MRI các phần mềm	   \n* Chụp MRI cổ chân	   \n* Chụp MRI cổ tay	   \n* Chụp MRI cột sống cổ	   \n* Chụp MRI cột sống lưng	   \n* Chụp MRI cột sống thắt lưng	   \n* Chụp MRI gan mật	   \n* Chụp MRI gối	   \n* Chụp MRI háng	   \n* Chụp MRI hầu họng	   \n* Chụp MRI hốc mắt	   \n* Chụp MRI khớp vai	   \n* Chụp MRI sọ não	   \n* Chụp MRI Tiểu khung	   \n* Chụp MRI toàn thân	   \n* Chụp MRI tuyến yên	   \n* Chụp MRI vú 2 bên	   \n* Thuốc đối quang từ', '2024-01-10 00:32:42', '2024-01-10 00:32:42');
